INSERT INTO "Podcasts" VALUES(1864,'530ae6ec418d61af5d8769d6','US Unemployent is Over 30%! - An Interview with Dr. John Russo','workingclassstudies.wordpress.com John B. Russo, Ed.D, is the Coordinator of the Labor Studies Program at the Warren P. Williamson College of Business Administration at Youngstown State University where he teaches courses on Labor Law and Negotiations, Occupational Safety and Health and Work in America. He is also the Co-Director of YSU''s Center for Working Class Studies. Dr. Russo has worked regularly with trade unions and has been a labor negotiator himself. He is considered an expert on labor and workplace issues and has consulted regularly on collective bargaining, economic restructuring, pensions, and bankruptcy in manufacturing and transportation from a labor perspective. Dr. Russo has written widely on labor and social issues, given testimony before government commissions, and has been frequently interviewed by the media on workplace issues.His current research interests involve comparative studies of the automobile industries in North America, China, and India and a book on worker rights in the global economy.',1,1308857400000,1868);
