INSERT INTO "Podcasts" VALUES(1908,'530ae6ec418d61af5d876a02','Dr Peter Gray Interview: School Is A Prison!','Peter Gray is a research professor of psychology at Boston College. He has conducted and published research in comparative, evolutionary, developmental, and educational psychology; published articles on innovative teaching methods and alternative approaches to education; and is author of Psychology (Worth Publishers), an introductory college textbook now in its 6th edition. He did his undergraduate study at Columbia University and earned a Ph.D. in biological sciences at Rockefeller University. His current research and writing focuses primarily on children''s natural ways of learning and the life-long value of play. His own play includes not only his research and writing, but also long distance bicycling, kayaking, back-woods skiing, and vegetable gardening.',1,1314025200000,2698);
