INSERT INTO "Podcasts" VALUES(2070,'531feb3e75b6965c14000064','Anarchy Versus the State - Stefan Molyneux of Freedomain Radio Debates Jake Diliberto','Stefan Molyneux, host of Freedomain Radio, engages in a ferocious debate with Jake Diliberto about the value and violence of US foreign policy, the long-term effects of the US involvement in World War I, the destruction of civilians in Iraq and Afghanistan, and the ethical foundations of a truly free society. Jake Diliberto is a Political Scientist and Christian Theologian. He is a Ph D. candidate from UK University of Birmingham, and is a resident scholar on US National Security. He is the co-founder of Vets for Rethinking Afghanistan. Jake is a specialist in Religious Conflict and Religious Guerrilla Warfare. He served as a US Marine in Operation Enduring Freedom in 2001 Af-Pak, and Operation Iraqi Freedom in 2003. Jake is a co-founder of Veterans for Rethinking Afghanistan and a policy adviser and analyst with US based advocacy organization Rethinking Afghanistan.',1,1337284800000,4260);
