INSERT INTO "Podcasts" VALUES(2731,'542f9e1e0868ce00698b90f1','The Truth About Richard Nixon ','Richard Nixon was a controversial United States president during the Cold War against the Soviet Union. Even though he was re-elected after a landslide victory in 1972, he became the only president in US history to resign from office. If you think Watergate was a scandal, you don''t know anything about Richard Nixon. Sources: http://www.fdrurl.com/nixon',1,1412439000000,3230);
