INSERT INTO "Podcasts" VALUES(2733,'5432bc410868ce0b278b900b','Should Freedomain Radio be funded by the State? - Saturday Call In Show October 4th, 2014','What can we as individuals do to make governments answer mass protests in a timely and efficient manner? In what ways can citizens ensure that their voices are heard and answered to accordingly? How does introversion play into me being tired of people''s demands while trying to overcome self-imposed isolation? My life is tormented by social anxiety, shame and my dependent, yet distant relationship with my parents. I suspect the roots of my issues lie in my childhood, so why do I feel so much tension and so ambiguous about confronting my parents for answers?
INSERT INTO "Podcasts" VALUES(2734,'54347fd10868ce4d2f8b9df1',' The Truth About Ayn Rand: Origins [1 of 4]','What is the truth behind Ayn Rand, writer of such blockbuster novels as ''The Fountainhead,'' ''Atlas Shrugged,'' ''Anthem'' and ''We The Living''? Rand - and her philosophy Objectivism - have been enormously influential to public figures as diverse as Paul Ryan, Ron Paul, Rand Paul, Rush drummer Neil Peart, Star Trek creator Gene Roddenberry, Hunter S. Thompson, Murray Rothbard, John Stossel, Penn Jillette and many others. Some of her adherents - such as former Federal Reserve Chairman Allan Greenspan - have been criticized for enacting Rand''s ''Virtue of Selfishness.'' Was she an advocate of egoism and ''me-first'' selfishness? Why did Rand hate altruism - not to mention Immanual Kant? What was her ideal society? Is her vision achievable? Should we even try? Stefan Molyneux, host of Freedomain Radio, uncovers the hidden history behind the Ayn Rand phenomenon, in part one of a multi-part series.',1,1412726580000,5012);
INSERT INTO "Podcasts" VALUES(2735,'54363fd10868cec9138b720f','The Truth About Ayn Rand: Objectivism [2 of 4]','What is the truth behind Ayn Rand, writer of such blockbuster novels as ''The Fountainhead,'' ''Atlas Shrugged,'' ''Anthem'' and ''We The Living''? Rand - and her philosophy Objectivism - have been enormously influential to public figures as diverse as Paul Ryan, Ron Paul, Rand Paul, Rush drummer Neil Peart, Star Trek creator Gene Roddenberry, Hunter S. Thompson, Murray Rothbard, John Stossel, Penn Jillette and many others. Some of her adherents - such as former Federal Reserve Chairman Allan Greenspan - have been criticized for enacting Rand''s ''Virtue of Selfishness.'' Was she an advocate of egoism and ''me-first'' selfishness? Why did Rand hate altruism - not to mention Immanual Kant? What was her ideal society? Is her vision achievable? Should we even try? Stefan Molyneux, host of Freedomain Radio, uncovers the hidden history behind the Ayn Rand phenomenon, in part two of a multi-part series.',1,1412841300000,5466);
