INSERT INTO "Podcasts" VALUES(2738,'543ae4e20868ce4a2f8bc3e8','The Legend of the NAWALT* - Saturday Call In Show October 11th, 2014','*Not All Women Are Like That. One of the most entertaining shows of the year. Includes: women using children as emotional tampons, the female desire for control, emotional pedophilia, favors from women is like money from the mafia, the irrational boner, beware the surreptitious promise upgrade, words you never want to hear, diversity is racist, unparenting concerns, MGTOW philosophy, being scared to be honest with women and efficiency in finding a quality relationship partner.',1,1413145620000,11107);
INSERT INTO "Podcasts" VALUES(2739,'543b779c0868ce0a278bcc87','Christopher Columbus: Bankrupting an Empire ','Media outlets generally don''t shy away from exposing the truth about this American hero and most people who educate themselves outside the propaganda vacuum of public schools know that in the 21st century the man would be put on trial for crimes against humanity - well, unless he managed to reach the summit of political power. There is, however, one aspect of Columbus'' sins that gets ignored.',1,1413183300000,161);
