INSERT INTO "Podcasts" VALUES(2741,'5440607e0868ce752b8b72c7','The Psychology of Trolls - Wednesday Call In Show October 15th, 2014','How can you identify cognitive distortions and bad arguments? Does your theory of "magic as madness" in fantasy stories have any additional criteria or is it universal? I’m religious – can you point out any holes in my thinking? Includes: string theory non-argument absurdity, free market thoughts on physics, self-detonating statements, Anita Sarkeesian’s death threats, facts can’t be racist, the psychology of trolls, the Sam Harris/Bill Maher/Ben Affleck situation, anxiety management through magical thinking, Harry Potter theory, giving Socrates an IQ test, sanity relative to social norms vs. reality, an emotional relationship to religion, the absurdity of death threats included in moral teachings, the vengeful podcaster, being erased in a relationship and marrying somebody with whom you have philosophical disagreements.  
