INSERT INTO "Podcasts" VALUES(2744,'54444ef50868ce88098babe7','Feminism: Unequal Opportunity Nagging ','Listener Question: "Feminism is literally defined as the idea that men and women are equal, and yet no facet of feminist media ever actually provides any logical backing to this claim. This does not mean it isn''t true, but they aren''t justifying it at all. It would be like having an atheist movement filled with people who didn''t give any reason for why there is no God. What are your thoughts on this criticism?"',1,1413762540000,1888);
