INSERT INTO "Podcasts" VALUES(2747,'5449f38c0868ce5a618b5727','The Necessity of Being Inconvenient - Wednesday Call In Show October 22nd, 2014','To what degree should we control our child''s exposure to other adults who are not peaceful parents? Which stories or books do you read to your daughter and why? How can I get over my attraction to jerks and develop a more mature understanding of love? Includes: When concerns are not acknowledged they continue, the inability to admit when you’re wrong, modeling behavior for children, having standards for interactions, religious afterlife as a safety net, grandparent trouble, not rewarding non-improvers, media as a substitute for parenting, the military as a library with guns, hitting you forties, being an older parent, vaginal masochism, sleeping around is bad for your heart, living off flings, landmines in relationships, the necessity of being inconvenient to other people and fighting against evolution.',1,1414139580000,11383);
INSERT INTO "Podcasts" VALUES(2748,'544b02da0868ce54618b5e57','What Pisses Me Off About The Michael Brown Shooting ','Stefan Molyneux is irritated - a scathing look at the rush to judgment and fervent race-baiting in the Michael Brown shooting case. New evidence and witness testimony has emerged as the grand jury decides the future of Officer Darren Wilson in the aftermath of the Ferguson, Missouri riots.',1,1414201680000,878);
