INSERT INTO "Podcasts" VALUES(2750,'545271480868ced5348b54ef','Sex, Polyamory and Reproductive Strategies - Wednesday Call In Show October 29th, 2014','How is self-knowledge defined or manifest in young children, and how do I know if I''m helping my daughter to develop it? Should I teach my daughter to say please and thank you- and how does one do that, without using the concept of obligation/subjugation? There is no doubt monogamy is a higher cost on men in general as we are built to spread our seed and woman are built to be selective, what do you think about this in reference to your recent comments on polyamory? Sometimes our child hits us when he’s tired, how should we react in the moment and how do we stop this behavior? What are your thoughts on the Waldorf education model?
