INSERT INTO "Podcasts" VALUES(2752,'54569d700868ced5348b6c20','Parenting Without Punishment - Saturday Call In Show November 1st, 2014','As a parent, when is and when isn''t it appropriate to say no? How do you prepare children for siblings? Is Aristotelianism compatible with atheism? We’re peaceful parents, but believe that we’ve made some mistakes, is it okay to not be 100% philosophical parents? As parents we’ve found that we use negative consequences more than positive ones, is this bad? What is the difference between teasing and abuse?
INSERT INTO "Podcasts" VALUES(2753,'545a8d180868ce184f8b468f','The Hidden Dangers of Bitcoin ','Bitcoin is a revolutionary decentralized architecture which can be used for an untold number of incredibly valuable services – including the transfer of financial value. As Bitcoin adoption continues to expand, significant interests are threatened and early users could face an incredibly dangerous backlash. Please protect yourself, a fight is coming…',1,1415220360000,1057);
INSERT INTO "Podcasts" VALUES(2754,'545d16bd0868ce90158b91c9','Parental Responsibility: Examined and Explained','To what degree to we hold parents responsible for the wrongs they do to children? Looking to the criminal justice system, punishment of children at home and the punishment/reward system in public school for existing answers.',1,1415386680000,4028);
INSERT INTO "Podcasts" VALUES(2755,'545e6bd70868ceda348ba0bf','An Algorithm of Permissible Hatred - Wednesday Call In Show November 5th, 2014','The capitalist property owners have historically structured a state to protect their land and oppress their workers.  How would an anarcho-capitalist society avoid the arising of this state? In a universe that is ruled by physical law with models of reality that can predict future events without fail, how is the human brain any different and not subject to cause and effect? In one of your videos you discussed what an argument is, but I''d like to know when arguments are necessary?
INSERT INTO "Podcasts" VALUES(2756,'545fb5680868ce26048b88e7','Merchant of Injustice - Saturday Call In Show November 8th, 2014','To what extent can we hold parents morally responsible for having children in developing nations where impoverished people exploit them as labor to work the land for survival? If you accept that free will is not supported by biology or physics, and you presumably accept that it''s hypothetically possible for decision-making (and any other characteristic of free will) to be an illusion, then does that not make free will an extraordinary claim requiring extraordinary evidence? Why am I so attracted to narcissistic women - is there something fundamental to which I’m currently blind?   
