INSERT INTO "Podcasts" VALUES(2759,'54663dce0868ced32f8b750f','The Fall of Germany. There Will Be No Economic Recovery. ','The current state of the German economy, including government spending, runaway electricity costs, green energy scams, wildly increasing housing costs, skyrocketing budget deficits, cheap money policies, public sector worker pensions, collapsing GDP growth, retirement savings, educational spending, health care costs, the myth of austerity, taxes, military spending, inflation, standard of living, income distribution, unemployment and mental health.
INSERT INTO "Podcasts" VALUES(2760,'54669ded0868ce07308b75f8','Life: Experience Required - Wednesday Call In Show November 12th, 2014 ','Is inaction by its nature morally neutral? How does one become motivated? I cheated on my wife for 8 years - is it possible to salvage our relationship given our long history of dysfunction? I''m striving for a virtuous relationship but I''m having trouble insofar as I tend to choose people who seem honest, but still give me some red flags. How much should I invest in these people?',1,1416011040000,7776);
INSERT INTO "Podcasts" VALUES(2761,'5468f2030868ced12f8b823f','28% of Men and 40% of Women ','What is currently impacting approximately four out of ten Americans - or 92 million people? Over ninety-two million Americans age sixteen and older are no longer participating in the labor force - meaning they’re not currently employed or actively searching for work. This is the highest amount of individuals opting out of employment in thirty-six years. Approximately one out of every six American men in their prime working years - 25 to 54 years old - does not have a job. Only 47% of working-age Americans have full-time jobs. 
INSERT INTO "Podcasts" VALUES(2762,'546a56a00868ced32f8b8f50','What Pisses Me Off About Kim Kardashian ','Hey, football is on! Did you see what happened on the latest episode of The Walking Dead? Oh man, can you believe Eminem swore in front of some military veterans at a concert? Is Macaulay Culkin dead or not, I’m not sure… wait, who’s Miley Cyrus dating now? Oh man, the Fast And Furious 7 trailer is out! Oh, Johnny Depp was drunk at an awards show, no kidding! So yeah, Kim Kardashian has a large ass. She''s all about that bass bout that bass, yeah, I got it, I got it, I got it. That is what draws attention in today’s world… I just hope the next time Kim Kardashian drops her pants and has her photo taken... Hi Mom... she takes a magic marker and writes a little bit of the important news on her ample cheeks.  Maybe then it will get some attention…',1,1416254940000,277);
INSERT INTO "Podcasts" VALUES(2763,'546ad5250868ce66688b4d9f','The Dangers of Isolation - Saturday Call In Show November 15th, 2014','I have blanks in my blanks in my memory, is it possible to recover early childhood memories - or - how can somebody achieve closure despite having memory blanks? When starting a business or project – how do you find investors? Since babies naturally demand that their needs are served without consideration for their caregivers – are babies naturally narcissistic who best outgrow their narcissism with peaceful and compassionate parenting? My in-laws are religious and I’m not – do you have any advice on how to approach them regarding boundaries involving my child? 
