INSERT INTO "Podcasts" VALUES(2766,'5470373a0868cec9718ba811','Obama’s Executive Order: Immigration, Amnesty and Contradictions','President Barack Obama recently spoke on the "executive action" he was taking to deal with the broken immigration system in the United States. Stefan Molyneux breaks down the speech, examining what was said, what wasn''t said and the hidden contradictions.',1,1416640140000,1235);
