INSERT INTO "Podcasts" VALUES(2768,'547548380868ce5a3f8ba318','Moving The Human Race Forward - Sunday Call In Show November 23rd, 2014','Why should somebody be moral? If there isn’t a God then is the universe simply just random happenstance with no deeper intent?  Do you think that in order to start a family you need to have a high paying career and income?   When I feel a desire to help people - how do I know that I’m acting out of genuine care, and not trying to fill my own emotional needs inappropriately by parenting others? Includes: welfare state of human progress, ripping science out of the womb of superstition, moving the human race forward, modern education as Chinese foot binding, the biological basis of empathy, imposing conclusions on children, commandments under the threat of death, turning off the fog machine, hunting for eggs and confessions of a social climber.',1,1416972120000,11217);
INSERT INTO "Podcasts" VALUES(2769,'547744320868ce6f298b53e7','The Truth About Bill Cosby ','Recently comedy and television legend Bill Cosby has been accused of multiple instances of egregious sexual assault. Given Cosby’s clean cut public persona – even allegations of such behavior is enough to send shock-wave throughout the world. In this presentation, we take an extensive look at the life of Bill Cosby – what made him who he is, his influences, childhood, career, cultural impact, philanthropy, history with the media, controversial comments about the black community, commitment to education, successes – and known flaws.  Was Bill Cosby like the image he portrayed on television? Was the Cliff Huxtable character he portrayed on The Cosby Show a reflection of his own personality and life? What can we learn from his life and career? What is the truth about Bill Cosby?',1,1417102200000,6494);
INSERT INTO "Podcasts" VALUES(2770,'547817e40868ce75298b5bbf','Tinder, Slut Shaming and Relationship Economics - Wednesday Call In Show November 26th, 2014','I keep on having "end-the-relationship" kind of conversations in my head with people who are already gone from my life - why does this happen? I’m a professional nanny – how can I best assist my client’s children with their behavior problems despite the fact I’m not their biological parent? Is it immoral to be a feminist – or to hold other illogical positions? Since those with the lowest socioeconomic status have the most to gain by using “the power of the gun” for the redistribution of wealth – how would a free society prevent this from happening? Includes: the death of a father, thousands of un-had conversations, trying to provoke self-attack in other people, relationship economics, relaxing into reality, philosophy as a life raft, getting excited about hypocrisy, in praise of slut shaming, turning children into property centers, the vagina boomerang, TINDER, people that refuse to learn, the price for irrationality is suffering and injecting cocaine into George Zimmerman’s eyeball.',1,1417156380000,9896);
INSERT INTO "Podcasts" VALUES(2771,'547a4a2c0868ce74298b6b6f','A Personal Message from Stefan Molyneux','Please help us continue to fight the good fight - we cannot do it without you! http://www.freedomainradio.com/donate',1,1417300440000,158);
INSERT INTO "Podcasts" VALUES(2772,'547c27ab0868ce78298b7b3f','Alpha Males vs. Beta Males - Saturday Call In Show November 29th, 2014','Should it be a crime to use force against someone who is hurting an animal? My girlfriend broke up with me because she said I was too passive and dependent – how do I get her to understand that this simply is not true? What do you do if your romantic partner can never admit that they are wrong? Includes: Danny Devito fighting a Great Dane, get off my lawn – or I’ll shoot, there is no omniscient god of ethics, don’t fog me bro, passing shit tests, selling eggs on the open market, the danger of gratitude, biological divers for romantic attraction, passivity is not a virtue, trading eggs for resources, beauty as power, don’t impregnate somebody out of pitty, white-knighting, refusal to give individuals moral agency, climbing out of poverty and donating a Ferrari to Freedomain Radio.',1,1417462320000,12950);
INSERT INTO "Podcasts" VALUES(2773,'547e26c70868ce74298b8c00','Stopping America''s Suicide by Race','Why I focused on Ferguson and the Michael Brown shooting: the LA riots of 1992 - dozens of people slaughtered, 2,000 people injured, 3,000 fires set, and a billion dollars of property damage - race baiting and rioting feeds the police state, cripples poor neighborhoods, and creates more and more dependence on the state and its power...',1,1417552980000,1226);
INSERT INTO "Podcasts" VALUES(2774,'547ff9010868ce71298b99df','Dr. Nathaniel Branden: A Farewell ','Stefan Molyneux, Host of Freedomain Radio, gives a moving elegy for Dr. Nathaniel Branden on the day of his death. Nathaniel Branden (April 9, 1930 – December 3, 2014) was an American psychotherapist and writer known for his work in the psychology of self-esteem. A former associate and romantic partner of Ayn Rand, Branden also played a prominent role in the 1960s in promoting Rand''s philosophy, Objectivism. RIP Dr. Branden.',1,1417672800000,1344);
INSERT INTO "Podcasts" VALUES(2775,'54817d2d0868ce37238b56d7','The Danger of Being a Drug Dealer - Wednesday Call In Show December 3rd, 2014','I have been a black market marijuana dealer for eight years. Is my behavior immoral? Must I sacrifice my marijuana dealing to find a virtuous romantic relationship partner? My girlfriend and I are expecting a baby from an unplanned pregnancy – what do we do? I was raised in a society that strips men of their ability of showing emotion and am now going into the military – how can I make it through this situation? The girl I''ve fallen for is being manipulated into hating me by someone who I used to think was a friend.  How do I get her to see the real me and not his made-up version?
INSERT INTO "Podcasts" VALUES(2776,'5482035d0868ceb4068ba367','An Introduction to Sophistry ','Stefan Molyneux discusses the history of sophistry – why it is the direct opposite of philosophy, how to identify sophistry and the dangers it brings the modern world.  soph•ist•ry - the use of fallacious arguments, especially with the intention of deceiving.',1,1417806540000,1675);
INSERT INTO "Podcasts" VALUES(2777,'548332650868cefd018ba6ef','The Truth About Eric Garner ','Stefan Molyneux looks at the unfortunate situation involving Eric Garner and Officer Daniel Pantaleo which left Garner dead and sparked a mainstream media outcry about police brutality and race relations. What do the facts say? Was Garner killed by an illegal chokehold? Was this a case of a racist white police officer attacking an innocent black man? How much of the Grand Jury testimony do we know? Was Ramsey Orta – Garner’s friend who filmed the viral video – arrested as retaliation for filming the incident? What is the truth about the Eric Garner situation? Sources: http://www.fdrurl.com/ericgarner',1,1417884120000,2306);
INSERT INTO "Podcasts" VALUES(2778,'5484f80a0868cefb6e8b720f','RIGHT?!?! – Saturday Call In Show December 6th, 2014','In the aftermath of the Michael Brown case - it seems as though the black identity is so rooted in being the victim or slave. I feel like many blacks cling to this identity in order to get a sense of unity and power, preventing them from excelling in the free market like other groups - do blacks really want to live in a free society? --- I am very angry at my parents for the emotional abuse that happened during my childhood. I feel stuck in this anger stage - how do I move forward and make peace with the past? --- Some people say that having children is aesthetically negative or morally wrong because the parent will inevitably transmit or project his/her unprocessed childhood trauma to the child.  Are any of these claims accurate, and by what standard do we judge them? --- I am the "quiet" one in many social occasions and have difficult opening up with new people whether it’s dating, work or family. How can I be vulnerable to the people I would like to know more about and have them to know who I am? --- Includes: without government somebody will rape your dog, promoting the idea that freedom is dangerous, the propaganda economy of fear-mongering, difficulty expressing your needs, bending a child’s will to it’s parental masters, objectification of people, asking people to surrender to manipulation to meet your needs, figuring out how to break the cycle of abuse, nihilism, beneficial discomfort and statists on a plane!',1,1418000100000,13567);
INSERT INTO "Podcasts" VALUES(2779,'548639b10868ce47618bcc58','The Economic Collapse Warning Sign You Need To Know. ','When the price of oil falls dramatically - it is a sign that economic activity is really slowing down. Stefan Molyneux discusses the current state of the economy, the reliance on debt for immediate financial survival, the drop in the price of oil, the OPEC (Saudi Arabia, Iran, Iraq, and Venezuela) price battle against American oil producers, the economic proxy war, sword of Damocles commodity derivatives and how this will impact the average person.',1,1418082660000,1087);
INSERT INTO "Podcasts" VALUES(2780,'5487842d0868ced65e8bba81','America in Decline. Prepare Yourself Accordingly. ','Many economists have discussed the impending economic collapse of the United States for years - but why hasn''t it happened yet? Were they wrong - or is there something else going on? Stefan Molyneux and Gerald Celente discuss the dangers of the current economic system, who''s really running the show, the disastrous military blow-back and the impact of never-ending war on a worldwide stage. Gerald Celente is the Publisher of the Trends Journal. For more information on Mr. Celente and Trends Journal go to: http://www.TrendsJournal.com',1,1418167140000,1580);
INSERT INTO "Podcasts" VALUES(2781,'5489ec520868cefd018bda80','The Strongest Version of Yourself - Elliott Hulse and Stefan Molyneux','Stefan Molyneux speaks with Elliott Hulse to discuss being a motivator, creating a system of practical steps to elicit personal change, ideas threatening the structure of society, environment impacting DNA via epigenetics, cooperation vs. coercion, the “newness” of the brain, body commonality, the mind-body dichotomy, transmitting enthusiasm, the attack on male sexuality, shadow material, the value of fathers, becoming clear about what you don’t want and moving towards achieving your dreams.',1,1418324880000,4566);
INSERT INTO "Podcasts" VALUES(2782,'548baa330868ce78298bf208','The Consequences of Anti-Male Propaganda - Wednesday Call In Show December 10th, 2014','I work in a Chinese school that still uses punishment – is it peaceful enough? Do you consider Nietzsche to be an Authoritarian? In reading Universally Preferable Behavior (UPB), I noticed that it did not include a proof for moral consideration, or how to identify whether or not something is a factor in the realm of morality.  A rock has no moral consideration, but a person typically does - where exactly is the line drawn? Includes: why compliance works, surviving to replicate, not everybody is looking to grow, living a life without boundaries, the hipster enthusiasm back hole, loathing culture, lies reinforced by time, the origin of consumerism is the lack of a parental bond, opposing third wave feminism, the consequences of anti-male propaganda, working parents have a long distance relationship with their children, subjective morality and a fantastic exploration of ethics.',1,1418439000000,11122);
