INSERT INTO "Podcasts" VALUES(2784,'548e12a80868cefd018bf7e9','IQ: Costs and Benefits - Saturday Call In Show December 13th, 2014','Why can''t other value systems - like God - achieve the same outcomes as Universally Preferable Behavior? You site the work of Charles Murray, Steven Pinker, and Nicholas Wade often when analyzing various topics and I have read books by all three authors - most recently reading "A Troublesome Inheritance" by Nicholas Wade.  If what Nicholas Wade proposes in his book is indeed, biologically speaking, the actual narrative of our ancestral past, then how is this incompatible with the more "anthropological" approaches to history, such as Jared Diamond''s "Guns, Germs, and Steel?  Why can''t these two be compatible?  Also, a very important question regarding Wade''s book, why do you think he titled it "A Troublesome Inheritance?"  "Troublesome" for who? Why does it always seem like people with issues are drawn to me for consolation - and then leave me when they don''t need me anymore?',1,1418596200000,12066);
INSERT INTO "Podcasts" VALUES(2785,'54905d0a0868cec34f8b6089','The Truth About Rape Culture ','What is rape culture? Rape culture describes the cultural makeup of a society where rape is pervasive and – due to people''s views on gender and sexuality – normalized. Feminists apply this term to societies throughout the world – and Western societies in particular – arguing that the issue of rape is downplayed or outright ignored – an attitude that significantly contributes to the vilification and revictimization of people who are raped. But what is the truth about rape culture? Sources: http://www.fdrurl.com/rape-culture',1,1418746980000,4032);
