INSERT INTO "Podcasts" VALUES(2787,'54972d790868cedd378b843f','Patriarchy Erotica - Friday Call In Show December 19th, 2014','The show starts off in unique fashion as Stefan reads some Patriarchy Erotica. Yes, this happened. What is the role of personality in achieving virtue? To what extent should I attribute my ''natural'' empathetic tendencies to my mother/upbringing and how much to being a good parent/person? Is education a human right? What are the major problems with education and how can they be fixed? How do you become memorable to other people?',1,1419193440000,11812);
INSERT INTO "Podcasts" VALUES(2788,'5498a6b90868ce70308bc4ff','The Truth About The Sony Hack | North Korea Opposition to ''The Interview'' Movie? ','Recently a group of hackers breached the Sony network and started leaking sensitive information about the company. According to the FBI and the media, the state of North Korea carried out the attack in an attempt to suppress the release of an upcoming film called The Interview. The film is starring Seth Rogen and James Franco and features a controversial scene in which the North Korean dictator Kim Jong-un gets assassinated. Sony ultimately decided to pull the release the film, a move which President Obama condemned. What is the truth about the Sony hack? Sources: http://www.fdrurl.com/sonyhack',1,1419287160000,2114);
INSERT INTO "Podcasts" VALUES(2789,'5499bf4f0868ce37238c06d3','Is Google Evil? | Propaganda Decoded ','If you''ve spent any time on the internet, you''ve probably heard of Google''s evil ways, which are most-often associated with the amount of personal data the company collects and the privacy issues that come along with this practice.
INSERT INTO "Podcasts" VALUES(2790,'549bcb020868ce47618c6c9c','The Christmas Truce of 1914','A deeply emotional look at the Christmas Truce of 1914 - which was a series of widespread but unofficial ceasefires between German and British soldiers during World War I. In the week leading up to the holiday, soldiers crossed trenches to exchange seasonal greetings and talk. In areas, men from both sides ventured into no man''s land on Christmas Eve and Christmas Day to mingle and exchange food and souvenirs. There were joint burial ceremonies and prisoner swaps, while several meetings ended in carol-singing. Men played games of football with one another, giving one of the most enduring images of the period. An excerpt from The Truth About World War 1: The Hidden History.',1,1419496080000,484);
INSERT INTO "Podcasts" VALUES(2791,'549e4df40868ceb4068c6ae8','Racist Until Proven Innocent - Wednesday Call In Show December 24th, 2014','Merry Christmas and Happy Holidays everybody! In your the ‘Truth About Eric Garner’ video - why did you spend so much time arguing that the police were not responsible for Eric Garner''s death, given your conclusion at the end of the video? Was this not a great opportunity to reach out to those who are concerned about police violence and point out the violent nature of the state and the futility of government reform?',1,1419660600000,6665);
