INSERT INTO "Podcasts" VALUES(2793,'54a1c4f50868ceb4048c692e','The Machine of Human Disassembly ','If “The Christmas Truce of 1914” could happen for one day - why couldn’t it happen every single day? Stefan Molyneux comments on the grim calculation that people make when they are caught in the machinery of war and the true nature of heroism.',1,1419887760000,1490);
