INSERT INTO "Podcasts" VALUES(2796,'54a795300868ce86178b5e4f','GIVING UP THE GHOST - Thursday Call In Show - January 1st, 2015 ','How can you have any type of ethical system or society without the concept of “rights” - which people will be punished for (not necessarily by a government) if they are violated? Is the belief in God more of an instinct than it is a belief? Includes: Universally Preferable Behavior, Utilitarianism, “disciplining” children, taking away responsibility through determinism, they did the best they could, the pros and cons of religion, atheist moral nihilism, godless communists, the compatibility of religion and rational philosophy.',1,1420268280000,8371);
INSERT INTO "Podcasts" VALUES(2797,'54aa06690868cea8218b58af','The Soft Bigotry of Low Expectations - Saturday Call In Show - January 3rd, 2015','During the “Racist Until Proven Innocent” show, part of the discussion involved the historical context of racism in America - how much does the modality in which racism is expressed depend on the regional and cultural differences within the United States? What causes a person to change and what are the limits that can be expected as to how much a person can change? Where does virtue come from - is it just a biological expression as a result of evolution? Are non-merit based valuations the initiation of force?',1,1420428600000,7875);
