INSERT INTO "Podcasts" VALUES(2800,'54af0da30868ce80708c256a','Was Jesus a Libertarian? - Wednesday Call In Show - January 7th, 2015','I think the message of Jesus Christ is the most liberating in history, and if Jesus were on earth today he''d be a libertarian, if not an anarchist - do you agree? What direction will movies, books and fiction in general would go as humanity moves away from statism and more towards a free and peaceful society? Would you say that you''re better off having gone through abuse as a child since it''s made you a much stronger human being through overcoming it?',1,1420753920000,11766);
