INSERT INTO "Podcasts" VALUES(2802,'54b37a470868ce27378b5967','The End of the World - Saturday Call In Show - January 10th, 2015','Can Universally Preferable Behavior (UPB) be used without a legitimate theory of property rights? Are property rights enough to determine if an action is unethical? After the recent terror attacks in Paris, France - will it be possible to finally have an honest conversation about multiculturalism? There has been a call to "Unify the Republic" against terrorism at all costs - but due to the emotional sensitivity of this question - will the challenges of multiculturalism go unspoken?',1,1421047500000,6419);
INSERT INTO "Podcasts" VALUES(2803,'54b599730868ced1038b9a8b','The Truth About The Gender Pay Gap ','The gender pay gap is the difference between male and female earnings overall. It is generally suggested that the wage gap is due to a variety of causes, such as discrimination in hiring, differences in education choices and discrimination in salary negotiations.  What is the truth about the gender pay gap?',1,1421187300000,831);
