INSERT INTO "Podcasts" VALUES(2805,'54b8296a0868cedd378c7264','Man Boobs Smothered In Nutella - Wednesday Call In Show - January 14th, 2015','I’m a brand new father. My wife and I are planning a big move next fall, and I''m planning on leaving the corporate life to start my own business. I''m having some anxiety about whether I will have the drive and motivation to make my business successful. Can you help me figure out where this anxiety stems from and how to push through it?  |  My Jewish girlfriend wants to circumcise our hypothetical future child. How can I convince her that it’s not acceptable?  |  I have often found it difficult to confront people with their irrational behavior and often – simply don''t. How can I be assertive without being aggressive?  |  Is empathy a selfless act? If not, can there ever exist a self-serving component within empathy, where you aim to manipulate the emotional states of other people?  |  Includes: the importance of breastfeeding, embracing failure, fear as rocket fuel, the dangers of circumcision, benefits of Jewish traditions, a deficiency of sanity vs. a deficiency of knowledge and manipulation as a result of self- attack.',1,1421355120000,14151);
