INSERT INTO "Podcasts" VALUES(2807,'54bc23640868ce27378b9434','Thou Shalt Not Talk About My Momma - Saturday Call In Show - January 17th, 2015','As a student with a limited budget, how can prepare for the upcoming economic collapse? My wife theorizes that "there is no such thing as "just friends" - is a myth propagated by society and that men and women should be able to have honest, healthy relationships without sex entering the picture or being used as a wedge to divide people. Is the idea that “there is no such thing” as "just friends" a myth? Stefan has said that rights and governments don’t “exist” - what is the definition of existence? Includes: a fetish for economic efficacy, practical steps for self-protection, not subsuming to libertarian doom, sexual tension, insecurity as an opportunity for improvement, male isolation, a discussion of the different types of concepts and the pope has threatened to beat you up if you say anything about his mother.',1,1421615940000,10638);
INSERT INTO "Podcasts" VALUES(2808,'54bccd3d0868cea6478b87cc','The Truth About The Race War ','Over the years, the mainstream media has continually fanned the flames of racial division within the United States – and this has only intensified in light of the Trayvon Martin, Michael Brown and Eric Garner situations. In this presentation, we aim to briefly discuss some shocking inaccuracies within the mainstream media portrayal of various events.  Inaccuracies which are so incredibly brazen and deliberate that they undeniably illustrate intentions to convey a false narrative to the general public. We will then illustrate the unspoken incentives, both personal and political, which speak to reasons as to why these falsehoods continue to be propagated despite their disastrous consequences. Distorting reality does victims of every race, color, and creed an incredible disservice, and it is our goal to expose the false media narratives by presenting The Truth About the Race War.',1,1421659320000,3121);
INSERT INTO "Podcasts" VALUES(2809,'54be7ae30868ce7f668b4907','American Sniper: The Chris Kyle Story Revealed','Why has ‘American Sniper’ done so well at the box office? United States Navy SEAL Chris Kyle became one of the most lethal and dangerous snipers in American history. His pinpoint accuracy not only saves countless lives but also makes him a prime target of insurgents. Kyle served four tours of duty in Iraq, but when he finally returned home, he found that he could not leave the war behind.',1,1421769300000,1544);
