INSERT INTO "Podcasts" VALUES(2811,'54c17bc50868ce70668b6091','Science Is Not Harry Potter - Wednesday Call In Show - January 21st, 2015 ','What impact does the government and the heavily regulated economy have on the family structure - both now and moving forward? What is truth? And what is the difference between a philosophical truth and a scientific truth? To what extent can you journey through self-knowledge without a therapist?',1,1421966160000,7562);
INSERT INTO "Podcasts" VALUES(2812,'54c57e1c0868ceda538b669f','The Economics of Human Expertise - Saturday Call In Show - January 24th, 2015','Stefan Molyneux discusses the death of Saudi Arabian King Abdullah and the reaction of world leaders.  Questions Include: How would it be possible for our species to share geographical territory without the use of, or threat of the use of, force? How can I find a “unicorn” – otherwise known as an ideal romantic partner? In a recent video about Christians and Marxists, I was offended by the connection made between "atheist community" and "leftist". Why is it important to group people by a common trait? I''m starting a business in the tech field - how do you get and keep customers?',1,1422228840000,9658);
INSERT INTO "Podcasts" VALUES(2813,'54c6801e0868ce7d668b81c7','Socialists Take Greece: What This Means For Europe - And You! ','Greece''s far-left Syriza party swept to power supported by voters opposed to the terms of the nation''s international bailout. Under Syriza, the Greek Government will refuse to pay bondholders what they are owed, which is similar to what happened in countries like Cyprus and Argentina. The European Central Bank will be threatened to buy up Greek debt under the threat of default: Pay up or the Euro dies!',1,1422294900000,1623);
INSERT INTO "Podcasts" VALUES(2814,'54c7c4ab0868ce78668b896a','THE GOLD SCANDAL: What They Aren''t Telling You!','The Federal Reserve Bank of New York''s underground vault supposedly holds 7,716 tons of gold bullion - most of it in trust for foreign nations, central banks and official international organizations. The United States Bullion Depository, known as Fort Knox, is a fortified vault located within the United States Army post of Fort Knox, Kentucky, and used to store a large portion of United States gold reserves. But how much gold is really in these massive vaults - and how easy is it to withdraw reserves? The European debt crisis caused the Federal Bank of Germany to bring home Germany''s gold reserves - but it hasn''t been very easy - leading to widespread speculation of monetary foul play by the United States.',1,1422378060000,1037);
INSERT INTO "Podcasts" VALUES(2815,'54c9141b0868ce79668b91c7','The Fall of Greece. Prepare Yourself Accordingly. ','A discussion about the rise to power of the far-left Syriza party in Greece as a result of the recent elections - and the impact that it will have for all of Europe and the world! What is the truth about the austerity which Greece was under? What does their future look like?
INSERT INTO "Podcasts" VALUES(2816,'54cab4070868ce75668ba180','Hogwarts Wizards of Human Manipulation - Wednesday Call In Show - January 28th, 2015','Why do academic history professors tend to be leftists given that history has shown socialism to be a complete failure time after time? Why are music and art important to the human species? If peaceful parenting makes a peaceful society, then why does Western Europe - which is mostly against spanking, demonstrated by their anti-spanking laws – have some of the most statist people in the world? I want to talk to a pregnant co-worker about peaceful parenting - where do I start? How do you approach someone productively who holds opinions so far from your own?',1,1422570420000,7954);
