INSERT INTO "Podcasts" VALUES(2819,'54d10fc80868ce23778b5ca7','The Truth About Dalai Lama','Dalai Lama is a title given to the leader and high priest of the Yellow Hat sect of Tibetan Buddhism, who is considered to be the incarnation of the bodhisattva - a human being who has achieved an "enlightened" state - of compassion. Tenzin Gyatso, the main subject of this presentation, is the 14th Dalai Lama and is thought of as a reincarnation of his predecessor - the 13th. Buddhism originated from the Buddha, a prince in northeastern India, who abandoned the ruling class in search of a way to end the cycle of reincarnation - which was a core principle in Indian hinduism - and thus overcome human suffering. What is the truth about Dalai Lama? Sources: http://www.fdrurl.com/dalai-lama',1,1422987060000,4123);
