INSERT INTO "Podcasts" VALUES(2821,'54d3a0250868ce34778b6d69','What Pisses Me Off About Greece''s Debt Crisis','Did you know: 80% of the bailout money went to European Union banks that were Greek bondholders, and not the Greek economy. The Syriza party and its leader Alex Tsipras won last month''s general election in Greece with a pledge to write off half of Greece''s debt New Finance Minister Yanis Varoufakis said "too much time, hopes, lives" had been wasted by Greece''s forced austerity program. Stefan Molyneux discussed the Greece debt crisis, the role of the banks in creating this mess, the possibility of an outright default, the danger of derivatives, the destruction of the euro and how a Greece default could set off a global economic meltdown.',1,1423155060000,755);
INSERT INTO "Podcasts" VALUES(2822,'54d4434d0868ce23778b73ba','Landing The Planet - Wednesday Call In Show - February 4th, 2015','What happened when Miss Universe was asked - what can women learn from men? How many kids is too many? How long can a family reasonably home school? Regarding balancing children and career advancement - is it worth working 50 hour weeks given the lost time with children? When we say "to not murder" is Universally Preferable Behavior, do we imply the following “If you want to be virtuous, you should not murder"? Do you think there is a ''war'' on white people? What would narrative stories look like in a free and peaceful society?',1,1423196820000,9455);
