INSERT INTO "Podcasts" VALUES(2824,'54d7c1260868ce36778b8987','Extraordinary Claims Require Extraordinary Evidence - Saturday Call In Show - February 7th, 2015','Is it possible to simplify the argument for universal ethics? Do most parents really love and care about their children like they say? If so, how can 80%-90% of them reconcile hitting them? Does Objectivism - as formulated by Rand and Branden - tend to over-inflate the human ego in an unhealthy way? Is the Objectivist view of self-esteem unhealthy and absolutistic? Why are 18th and 19th century writers like Nietzsche and Schopenhauer considered philosophers since their claims aren’t falsifiable?',1,1423425600000,12277);
