INSERT INTO "Podcasts" VALUES(2829,'54de81040868ce3a778bb8f1','The Inertia of Human Personality - Wednesday Call In Show - February 11th, 2015','My husband and I are peaceful parents to a six year old boy, but we are at odds about how to deal with our son not taking our discussions to heart. Is an emotional reaction necessary for children to understand? What are reasonable expectations for a six year old? Previously you’ve suggested that people think of the world as a whole – and not just personal happiness - when choosing a career. How does this mesh with the objective belief that altruism is not a virtue?',1,1423867680000,7805);
INSERT INTO "Podcasts" VALUES(2830,'54de81cb0868ce3a778bb8fa','P!nk Would "Rather Go Naked"','P!nk recently teamed up with PETA (People for the Ethical Treatment of Animals) to create an advertisement and join a long list of celebrities who''d "rather go naked than wear fur." While one can certainly understand her concerns about animal treatment - something she''s said in the past makes this a bit confusing.',1,1423868280000,299);
