INSERT INTO "Podcasts" VALUES(2832,'54e151de0868ce34778bcc1f','Will Artificial Intelligence Kill Us All? - Saturday Call In Show - February 14th, 2015','What do Fifty Shades of Grey and Passion of the Christ have in common? The technology community is in agreement that Artificial Super Intelligence is an inevitability. Timelines range from 15 years to the end of the century and projected outcomes are polarized: human extinction or human immortality. Do you think ethics could be programmed into AIs to keep them safe in the event they become Super Intelligent? I’ve been in a romantic relationship for seven years and I’m not happy - how do you know whether to stay or leave? What do you think is the freest country in the world?  With so many countries moving farther away from a free society, what countries do you think are moving in the right direction toward freedom?',1,1424052480000,10147);
INSERT INTO "Podcasts" VALUES(2833,'54e6185e0868ce3a778bee6b','The Inevitability of Economic Collapse - A Conversation with G. Edward Griffin ','Stefan Molyneux and G. Edward Griffin look at the central banking scam, the crisis in Greece, the inevitability of economic collapse, the possible collapse of the Euro, widespread panic in the Eurozone, Gold as a historical store of financial value, the practical impossibility of solving the problems in Greece and fiat currency withdrawals.
INSERT INTO "Podcasts" VALUES(2834,'54e643510868ce25778bf371','The Power of Sexuality - Wednesday Call In Show - February 18th, 2015 ','An incredible look into relationships and dating with two powerful conversations. In ‘The Philosophy of Forgiveness’ it is said that for every bad moment it takes ten good ones to make up for it. How is it possible to repair a relationship if this positive to negative ratio is already messed up? I was recently dumped by my boyfriend of two years after he reconnected with an ex-girlfriend.  Is it possible that men who feel inadequate or unworthy in a relationship will downgrade or sabotage relationships with ideal mates in order to feel more adequate or powerful with more dependent women?',1,1424376420000,10856);
