INSERT INTO "Podcasts" VALUES(2837,'54eb9e350868ce3a778c142c','If Slaughterhouses Had Glass Walls - Saturday Call In Show - February 21st, 2015','Does it violate the non-aggression principle to not be a vegan? Why are virtuous individuals drawn to religion when the bible has so many contradictions and depictions horrendous acts? Isn''t marriage simply a monopoly on your partner''s choices? Why is it that many creative people involved in collegiate arts (film/theater) are incredibly statist in nature? How much of creativity is developed and how much is innate?',1,1424727240000,11304);
INSERT INTO "Podcasts" VALUES(2838,'54ed8d7a0868cef86b8b6e70','Human Intelligence: The Flynn Effect - A Conversation with Dr. James Flynn ','Dr. James R. Flynn is emeritus professor of political studies at the University of Otago in Dunedin, New Zealand and author, most recently, of What is Intelligence? Beyond the Flynn Effect. Flynn is best known for the Flynn effect, the continued year-on-year rise of IQ scores in all parts of the world. Flynn’s research combines political and moral philosophy with psychology to clarify problems such as justifying humane ideals and whether it makes sense to rank races and classes by merit.',1,1424854140000,4488);
INSERT INTO "Podcasts" VALUES(2839,'54efc3780868cefd6b8b7e90','The Big Picture - Wednesday Call In Show - February 25th, 2015','How can one deal with social anxiety - especially when it comes to dating? Are there negative consequences for adult children being financially dependent on their parents? Doesn’t atheism require the burden of proof to claim that god doesn’t exist? In the recent “There Are No Solutions” video, you said there are no solutions, but is that really true?',1,1424999160000,10669);
INSERT INTO "Podcasts" VALUES(2840,'54f119bb0868ceae358bbe80','The Truth About Spock | RIP Leonard Nimoy ','Leonard Nimoy was an actor, film director, poet, singer and photographer - famous for his role as Mr. Spock in the original Star Trek series and multiple sequels. We examine the cultural impact of the Spock character, what Vulcans represented, how you can “live long and prosper” and if the needs of the many outweigh the needs of the few. 
INSERT INTO "Podcasts" VALUES(2841,'54f3af670868cef76b8b9a39','PAINT IT BLACK - Saturday Call In Show - February 28th, 2015','Is there an objective standard for determining what is Art? The common definition is subjective, using this standard the work of a deranged person smearing feces has the same value as a masterpiece done by a methodically trained, accomplished and dedicated artist. How do I apologize to someone while at the same time conveying the responsibility of others without it coming across as a bullshit non-apology?',1,1425255900000,8745);
INSERT INTO "Podcasts" VALUES(2842,'54f60b760868ce1b038b6f69','Needs and Intimacy: Avoiding Relationship Landmines ','A strikingly important look at the relationship between needs and the possibility for intimacy in relationships.',1,1425410820000,3486);
INSERT INTO "Podcasts" VALUES(2843,'54f89b7e0868ce56638c0b61','What is Art? - Part 1','A multi-part exploration of the question: What is Art? Stefan Molyneux makes the case that Art is often an argument for focusing on something which is easy for society to overlook. How do we put art in context? What can we learn about the artist by viewing their art? How can you explain modern art?',1,1425578700000,2594);
INSERT INTO "Podcasts" VALUES(2844,'54f89bfe0868ce0a2e8b70c7','What is Art? - Part 2','A multi-part exploration of the question: What is Art? Stefan Molyneux makes the case that Art is often an argument for focusing on something which is easy for society to overlook. How do we put art in context? What can we learn about the artist by viewing their art? How can you explain modern art?',1,1425578880000,2148);
INSERT INTO "Podcasts" VALUES(2845,'54fb4caa0868ce8e0c8b4607','The Truth About Sex: Facts You Won''t Believe Are True!','Some shocking trends regarding sexual activity and life outcomes - including the alarming reason why you haven’t already heard this information. There is a mind-blowing correlation in this presentation that you’ve never seen before - and it''s important that you know about it! In the first part of “The Truth About Sex” series, Stefan Molyneux looks at first age of sexual activity, the number of sexual partners, single mothers, abortion, sexually transmitted diseases, stable marriage, child maltreatment, divorce, crime and happiness statistics. What is the truth about sex – and what information do you need to know before playing the big person’s game which makes real people? Upcoming “The Truth About Sex” presentations will include a look at r/k reproductive strategies, polyamory/monogamy, porn, the impact of fatherlessness and much much more! Sources: http://www.fdrurl.com/marriage-sexual-partners-study',1,1425755040000,2606);
INSERT INTO "Podcasts" VALUES(2846,'54fbb0a10868ce8b0c8b4b7f','An Atheist Apologizes to Christians - Call In Show - March 4th, 2015','An incredibly powerful and deeply emotional conversation with a Mormon listener who has lost his faith - and is deeply conflicted about the possibly of leaving his community behind. | I am a very smart person, able to accurately analyze many aspects of life critically, but on the issue of religion, I am more often able to be a 99.999% atheist with the exception of my own emotionally powerful religion. I am confused about what is real and fearful of change while surrounded by spouse, family, friends, and colleagues who will reject me should I reject my religion. How can a philosophical approach help me with this schism in my life? | Socrates said he knew nothing except that he knew nothing. What is your attitude on epistemology and how does it inform your philosophy? Is it the foundation of your worldview - and should it be?',1,1425780720000,11702);
INSERT INTO "Podcasts" VALUES(2847,'54fce1450868ce880c8b5607','Irrational Optimism as Vanity - Call In Show - March 6th, 2015','A repeated pattern in my life has been the pursuit of a certain goal, the attainment of that goal and then disappointment.  Once I have what I want, I find out that it doesn''t make me happy - and am back to square one. What are your thoughts on this kind of pattern - and is this something you''ve experienced yourself? | Having watched "The Truth About Dalai Lama" presentation - do you have objections to the 4-Noble Truths and the 8-Fold Path from Buddhism or strictly the Dalai Lama as an individual? | What are your thoughts on resource based, money-free or gift economies?',1,1425858720000,8795);
INSERT INTO "Podcasts" VALUES(2848,'5502133c0868ce950c8b8512','Saying No to Marriage - Call In Show - March 11th, 2015','The caller wrote: “Most people, including Stefan, advocate committed relationships. However, I feel that voluntarism says that the best relationships are when both parties are allowed to behave and go as they wish to. How do we reconcile the idea of using social pressure and legality to force people to stay together through marriage with the basic principles of voluntarism?
INSERT INTO "Podcasts" VALUES(2849,'5506616b0868ce8b0c8ba948','Wage Fixing and Collusion! Listener Mailbag Questions - Answered!','Stefan Molyneux answers listener questions including: Do you think strict rules designed to change future behavior are a good thing or a bad thing? How can a market properly deal with the issue of wage fixing and illegal collusion among businesses to keep wages down? Is the non-aggression principle like a social contract? Why do children develop impulsiveness? Do you have advice for raising boys? Can there be such a thing as anarcho-socialism? If someone was hoarding the only antidote to an epidemic that was exterminating the human race - would it violate non-aggression principle to seize the antidote?',1,1426480860000,2453);
INSERT INTO "Podcasts" VALUES(2850,'5506646d0868ce950c8ba633','The Truth About School: Another Brick in the Wall!','Almost everybody has “experienced” public school at some point in their life – but what is the truth about school? While the stated goal has always been public education - what is the true origin and development of this institution? In this presentation, Stefan Molyneux described his own experience in public school, early education in Greece, the rise of formal education, the interesting religious backlash, the Prussian school system, modern public schooling, the shocking cost and effects behind this “necessary” institution.” As a student, are you just another brick in the wall? Sources: http://www.fdrurl.com/truth-about-school',1,1426482240000,2906);
INSERT INTO "Podcasts" VALUES(2851,'550884590868ce56118bb9b9','FACT: People Just Don''t Listen - Call In Show - March 14th, 2015','An in-depth discussion of the ‘An Atheist Apologizes to Christians’ show with thoughts and criticisms from a listener - including a callback to John Goodman’s powerful line from the movie Barton Fink: Because You Don’t Listen! Also included: Whose responsibility is it – the employers, employees or the recruiters - to find out whether or not the candidate is a good personality match for the team?  How important is this personality factor in having a successful business?',1,1426621020000,10615);
INSERT INTO "Podcasts" VALUES(2852,'550aff370868ce860c8bc903','Dungeons and Dragons - Oh Yes!','After several requests, Stefan Molyneux describes his experience playing Dungeons and Dragons.',1,1426783980000,1344);
INSERT INTO "Podcasts" VALUES(2853,'550cf16d0868ce81168bd357','The Isolated Male - Call In Show - March 18th, 2015','Ayn Rand''s novel ‘Anthem,’ the difficulty of achieving excellence, putting people in personality type cages, to categorization is dehumanization, the chains of unchosen familial roles, pushing circumcision on new parents, children as proxy wars, preserving sibling relationships, trying to escape emotions through immediate action, society as a self-correcting system, the evolution of individualism, having the back of the people you care about and female driven male isolation.',1,1426911420000,10426);
INSERT INTO "Podcasts" VALUES(2854,'550f24370868ce8b0c8be783','Take The Red Pill - Call In Show - March 21st, 2015','A rant-tacular show! Questions discussed include: Referencing the Matrix - do you believe that some people are just not ready for the red pill? I’ve given my two weeks’ notice at my job of fifteen years and am starting to panic - why do I feel so scared? Is the cultural focus on ‘beauty’ abusive towards women? I’m a public school teacher - how can I assist children who are being bullied and best help my students?',1,1427055480000,10309);
INSERT INTO "Podcasts" VALUES(2855,'551443d10868ce41428ba6db','Mandatory Vaccinations ','Lately there has been a huge discussion about vaccines in the United States. This isn’t a question about whether vaccines are safe or not - but as a philosopher, what are your thoughts on the mandatory requirements for anything - whether they be vaccinations, wearing of purple hats or college application fees?',1,1427391300000,1434);
INSERT INTO "Podcasts" VALUES(2856,'5514447c0868ce910c8c09ce','How to Overcome an Inferiority Complex - Call in Show - March 25th, 2015','I have a wonderful fiancée, but have recently come down with a crippling inferiority complex in light of her recent career success. I want to be supportive, but it’s tearing me to pieces inside and it makes me feel useless as a man. How can I simply accept the circumstances and see us as a team? How would a free society defend against an invading statist army? Do you think it will be beneficial for atheists to impersonate the best qualities of religion? Should atheists organize into churches, create holiday - and create their own traditions for marriage, funerals, and coming of age ceremonies?',1,1427391480000,7832);
INSERT INTO "Podcasts" VALUES(2857,'5516c65b0868ce7b0e8c18fb','Mandatory Voting. Thanks Obama! ','President Barack Obama has created a political firestorm by floating the idea of mandatory or compulsory voting. "If everybody voted, then it would completely change the political map in this country," Obama said, calling it "potentially transformative." Not only that, Obama said, but universal voting would "counteract money more than anything." Stefan Molyneux has some thoughts on the subject, mandatory voting?  Thanks Obama!',1,1427555820000,697);
INSERT INTO "Podcasts" VALUES(2858,'551863080868ce8b0c8c2516','Andreas Lubitz Germanwings Flight 9525 Crash | Propaganda Decoded','On Tuesday, Germanwings Flight 9525 crashed into the French Alps, killing all 150 people on board. The 27-year-old German co-pilot, Andreas Lubitz - locked the captain out of the cockpit, ignored desperate pleas to open the cockpit door and deliberately glided the plane straight into the mountains.
INSERT INTO "Podcasts" VALUES(2859,'5519b6d90868ce860c8c2ae6','The Estrogen Decoder Ring - Call In Show - March 28th, 2015','Do you think the rejection of altruism by Ayn Rand’s objectivist ethics is oppressive given the scientific research showing altruistic behavior in many primates? I recently came out of a six month relationship and have a very hard time trusting women due to my past experiences -  how do I know if certain warning signs are legitimate or if I’m simply being insecure? Includes: finger biting bonobos, how welfare destroys any sense of community, government as a replacement for love which wasn’t earned, craziness as sexual lubricant, the gloryhole of superstition, relationship warning signs, dodging bullets and a conversation everyone in the dating pool needs to hear.',1,1427748360000,10838);
INSERT INTO "Podcasts" VALUES(2860,'551a1bd00868ce7b0e8c3044','Why Advertising Corrupts','Freedomain Radio is 100% funded by viewers like you. Please support the show by signing up for a monthly subscription or making a one time donation at: http://www.freedomainradio.com/donate',1,1427774280000,605);
INSERT INTO "Podcasts" VALUES(2861,'551d8a520868ce41428be666','The Chains of Racial Identity - Call In Show - April 1st, 2015','As a mixed-race, American man, and I am deeply concerned about the increasing racial tension in America. Worse, I know that I am - at least, incrementally - part of the problem. I have experienced both white privilege and black disadvantage, white pride and black shame. In certain circumstances, I have even felt black privilege and white disadvantage, black pride and white shame. I believe that racial identity is a fiction to some degree; However, from a practical standpoint, I do not believe that human beings can completely overcome the instinct to stereotype others based on their physical features. How can I both humbly and proudly carry all the pieces of my real identity, racial pieces included? | Given the libertarian understanding of fiat currency and the banking system - what is the ethical approach to debt – such as long term mortgages?',1,1427999160000,7462);
INSERT INTO "Podcasts" VALUES(2862,'551deccb0868ce147e8be931','California''s Water Crisis | True News','An in-depth look at the real cause of the California water crisis and the history which lead to this challenging situation. Why are farmers trying to grow water intensive crops in a desert environment? How could farming in a desert possibly be cost effective? What role do taxpayer funded Dam projects and government subsidies play in this shortage?  Stefan Molyneux, host of Freedomain Radio, breaks down at the hidden story behind this growing problem.',1,1428024420000,881);
INSERT INTO "Podcasts" VALUES(2863,'5521a1a90868ce56118c6602','Neurotic Human Vending Machines - Call In Show - April 4th, 2015','It has been said that the reason for the low birthrates in Europe is the high level of taxes - how does Stefan explain nations such as Hong Kong, Korea, Japan, Taiwan and Singapore which have lower taxes and lower birthrates? | As a parent - do you think it’s important to make an effort to ‘socialize’ your children? | What are your thoughts on the morality and implementation of the “Unconditional Basic Income” welfare system both now and in the future?',1,1428267300000,5232);
INSERT INTO "Podcasts" VALUES(2864,'552589970868ce950c8c7cb8','Anti-Marriage Prejudice | YouTube Comments - Rebutted!','Stefan Molyneux dives into the hive mind of YouTube comments and responds to feedback. Do the laws of physics break down at the edge of the universe? Has Stefan joined the anti-platypus lobby? Does the world revolve around the opinions and power of white men? How much does Stefan really know about philosophy? Why doesn’t Stefan talk about analytic and continental philosophy?',1,1428523200000,3282);
INSERT INTO "Podcasts" VALUES(2865,'552600c20868ce8b0c8c867f','Pizza War: Gay Discrimination vs. Religious Freedom | True News ','Memories Pizza in Indiana is under heavy criticism after saying that they wouldn’t cater a gay wedding because it was against their Christian religious beliefs. Indiana’s Republican Gov. Mike Pence signed the “Religious Freedom Restoration Act” last week with the goal of giving business owners a stronger legal defense if they refuse to serve lesbian, gay, bisexual and transgender customers on religious grounds. Should businesses be forced to serve all potential customers? Should people be allowed to discriminate based on their religious beliefs? Stefan Molyneux, host of Freedomain Radio, takes a look at the Indiana Pizzeria controversy and the discrimination debate.',1,1428553800000,852);
INSERT INTO "Podcasts" VALUES(2866,'552775ce0868ceae368c9132','The High Cost of Fame - Call In Show - April 8th, 2015','I''m a gay restaurant server and I''d like to talk about the Religious Freedom Restoration Act - do you think there should be a law to prevent discrimination? | I''m working on a project that explores the motivations behind "stage parents," the potential negative psychological effects on their children involved, and the importance of raising your child to be an independent individual. What do you think it would take for these parents to realize the damage they''re doing to their children, if they are in fact forcing their unfulfilled dreams upon them? | Am I coming across as rational with my arguments against statism on social media?',1,1428649260000,10479);
INSERT INTO "Podcasts" VALUES(2867,'55284c1c0868ce7b0e8c932d','Winners and Losers ','Why are people so afraid of freedom?  Why do most individuals run to governments - eager to make an unholy bargain - sacrificing their freedoms for the illusion of protection and security?',1,1428704160000,1651);
INSERT INTO "Podcasts" VALUES(2868,'552b14cf0868ce147e8c42c2','Criticism: The Truth About Sex - Call In Show - April 11th, 2015','If you like rant-filled shows, then this is the show for you! | Given what we perceive to be a respectable track record for choosing compelling source material for "The Truth About" series video posts, this latest edition on "Sex" seems to have missed the mark for us after a casual listen and became grossly misleading after a more invested listen. Since when does a report generated by a DC based conservative think tank, with a mission to formulate and promote conservative public policies in the United States, constitute a valid body of knowledge to anchor such a definitive video title and 45 minute pontification on a topic as wildly divergent from culture to culture around the world and often even more diverse within the same local geography in modern urban environments? | What are your thoughts on the research out of social psychology on persuasion, influence, compliance, and its application to marketing and sales? These customers aren''t being FORCED into buying anything, but their decisions can become convoluted using information about their own neurological functions; functions they may not even be aware of. Is this moral? Is this ethical? Do you think this behavior would be encouraged, or discouraged, in a free market? | Do you recommend any particular methodology for cultivating, nurturing protecting and sustaining relationships?  Are people committed to self-knowledge and self-respect left to high turnover in relationships?',1,1428886560000,11825);
INSERT INTO "Podcasts" VALUES(2869,'552c2d0c0868ce60288b60f2','Rapegate | The Truth About Rape','Rolling Stone''s “A Rape on Campus" story about the University of Virginia chapter of Phi Alpha Psi. Columbia University’s Mattress Girl Emma Sulkowicz. Lena Dunham on "Barry" in “Not That Kind of Girl.” The Duke Lacross case. Tawana Brawley. The NFL''s Ray McDonald. What do all these cases have in common? It''s time for a frank conversation about rape, false rape accusations, the damage this does to the true victims of rape - and how we can stop it!',1,1428958320000,844);
INSERT INTO "Podcasts" VALUES(2870,'552d4a6e0868ce02208c47db','Walter Scott Shooting, Officer Michael Slager Charged | True News ','Officer Michael Slager pulled over Walter Scott in a routine South Carolina traffic stop - and the events which followed left Walter Scott dead and Officer Slager charged with murder and stripped of his badge. An incredibly shocking video was recorded by a witness, showing a struggle between the two men - ultimately ending with Officer Slager firing eight shots into Walter Scott''s back. What has been the reaction to this situation? What facts do we know?  Is this another Trayvon Martin or Michael Brown situation? Stefan Molyneux looks at the facts as they are known and shares an important message about this terrible situation.',1,1429031400000,852);
INSERT INTO "Podcasts" VALUES(2871,'552ec2240868ce011c8bce91','The Hidden Truth Behind California''s Water Rationing | True News ','In the middle of a massive drought, California braces for its first mandatory water reductions on urban consumption, which accounts for approximately ten percent of the state’s usage - but is that the REAL problem? Stefan Molyneux looks at the plethora of hidden causes of the California Water Crisis.',1,1429127580000,682);
INSERT INTO "Podcasts" VALUES(2872,'553136020868ce24368b477f','Consciousness, Free Will, Morality and Superstition ','Will further knowledge of the brain reveal consciousness and free will and morality to be superstitions? Will greater medical and scientific advancement reveal determinism to be true and the existence of free will and morality to be completely irrational?',1,1429288380000,2347);
INSERT INTO "Podcasts" VALUES(2873,'55352b300868ce41368b6317','D!#knapping - Call In Show - April 18th, 2015','Question 1: I’ve been involved in a love-triangle with myself and another man seeking the same woman. I no longer want to be involved in this kind of behavior, how do I hold myself to a higher standard of behavior in my romantic relationships? | Question 2: What is the right reason to become a parent? What would be the minimum requirements as far as personal qualities go to be able to responsibly make this choice? | Question 3: Is the donation model the best way to fund Freedomain Radio? Closing Conversation: The Walter Scott/Michael Slager shooting and important things to keep in mind.',1,1429547580000,9840);
INSERT INTO "Podcasts" VALUES(2874,'55366a560868ce0c368b6e2f','Liberals and Conservatives Will Never Agree - A Conversation with William Gairdner ','Stefan Molyneux and William Gairdner discuss the massive divide between liberals and conservatives - and why the two groups will never, ever agree.
INSERT INTO "Podcasts" VALUES(2875,'5537b1fa0868ce0b368b78bc','The Truth About Makeup','Makeup has been around for many centuries. When you look at the scientific evidence, it’s no wonder that over $40 billion dollars is spent on cosmetics each year. We are drawn to makeup because that it taps into our primal urge to find a young, healthy mate who will produce lots of kids so that we can pass on our genes. What is - The Truth About Makeup? | Freedomain Radio is 100% funded by viewers like you. Please support the show by signing up for a monthly subscription or making a one time donation at: http://www.fdrurl.com/donate',1,1429713240000,855);
INSERT INTO "Podcasts" VALUES(2876,'5539ab3e0868cefd1d8b48bf','Statists Gonna State - Call In Show - April 22nd, 2015','Question 1: What is the secret to staying well-informed about what’s going on in the world - but also maintaining your sanity and avoiding depression? | Question 2: After bringing philosophy into my romantic life, my friendships, and my family relationships, I am struggling to bring philosophy into the career side of my life. What are the benefits of bringing philosophy in the space of making money? | Question 3: Where do Christianity and philosophy intersect? What goals and principles do we have in common and how might we relate to each other in a way that is mutually beneficial? | Question 4: I''m in my final year of college, studying for a Bachelor''s in screenwriting, but I''ve completely lost my motivation and drive - how can I stop procrastinating and get the work done?',1,1429842600000,9868);
INSERT INTO "Podcasts" VALUES(2877,'553d3fe10868ce0b368b9e66','Eat. Sleep. Bad Decision. Repeat. | Breaking the Cycle - Call In Show - April 15th, 2015','Question 1: How you address the stereotyping and hyper-sexualization of female characters in popular culture - in particular kids'' video games - with your daughter? Also includes an in depth discussion of out of wedlock child birth, bad relationship choices, divorce, child custody disputes and how to break repetitive cycles of dysfunction. |Question 2: Do you think that you can “pay it forward” to the next generation and make the world a better place without having children?',1,1430076720000,7945);
INSERT INTO "Podcasts" VALUES(2878,'553d44450868ce24368b9d50','CRAYDAR | Crazy Detecting Radar System - Call In Show - April 25th, 2015','Question 1: What are the ethical and moral limitations of editing the human genome? Includes an impromptu minarchism vs. anarchism discussion. | Question 2: Universally Preferable Behaviour (UPB) Debate! | Question 3: What’s the best way of dealing with people who are being annoying?  | Question 4: What are some good ways to spot a sociopath? Includes a lengthy back and forth conversation about warning signs and red flags to keep in mind.  If you can think of more, please do email them to operations@freedomainradio.com and we’ll put together a massive list!',1,1430078340000,11887);
INSERT INTO "Podcasts" VALUES(2879,'553fb9000868ce1c368baab7','The Truth About Single Moms ','Single Mothers are talked about in glowing terms for their hard-work, determination and fortitude - but what is the truth about single moms? | Motherhood has evolved quite a bit over the last fifty years: more women are having their children later in life - or in less traditional ways: before and outside marriage. Single motherhood has become so incredibly common that it is projected that soon - half of all children will live with a single mom at some point before the age of eighteen. | What kind of impact does single motherhood have on society?  What impact does single motherhood have on children? Are Fathers important - and what impact does growing up in a fatherless home have? What is the Truth About Single Moms? | Sources: http://www.fdrurl.com/truth-about-single-moms | Transcript: http://www.fdrurl.com/single-moms-transcript',1,1430239260000,4455);
INSERT INTO "Podcasts" VALUES(2880,'554013490868ce2e368bb131','Black Lives Matter #BaltimoreRiots | True News','In the aftermath of Freddie Gray’s death in the hands of Baltimore Police - sections of Baltimore convulsed in riots, arson and looting. Stefan Molyneux looks at history, past decisions and their hidden impact - which have lead to serious frustrations within the black community.',1,1430262480000,2151);
INSERT INTO "Podcasts" VALUES(2881,'5542888f0868ce23368bbe18','You''re Making Me Guilty Damn You! | YouTube Comments - Rebutted!','Stefan Molyneux dips into the YouTube comments to discuss discrimination, passive aggression, the use of universal principles in Philosophy, socialist economics, supply and demand, money corrupting government climate science, scare-mongering for the purpose of gaining political power and making somebody feel guilt.',1,1430423580000,2594);
INSERT INTO "Podcasts" VALUES(2882,'554423710868ce6c1c8b6ee7','Coming Out of the Closet - Call In Show - April 29th, 2015','Question 1: I am a twenty-three year old, homosexual black American male, living in a religious family household. Do you have any advice or suggestions as how to be honest with my family about my sexuality? | Question 2: I’m currently an entrepreneur, but have the chance to take over the established family business.  I don’t think I can do both, and am conflicted about my choice – can family and business mix? | Question 3: What do you think of making it normal and completely above the table, for husbands to visit young prostitutes once their wife’s aging starts to show? | Question 4: Ever since I was young, I have had an irrational fear that everyone else is cocky, mean, and won’t like me - why am I terrified of people before I get to know them?',1,1430528700000,14536);
INSERT INTO "Podcasts" VALUES(2883,'55444f4c0868ce37368bca82','The Truth About Freddie Gray','On April 19, 2015, Freddie Gray, died as a result of injuries sustained while in the custody of the Baltimore Police Department. He was 25 years old. But the tragedies within this story began much much earlier - and continue, even after his early death. As Baltimore burned in the background and protestors rioted - criminal charges were filed against the six police officers who were believed to be involved in his death. Will the justice be served in a court of law - or are there more complicated elements involved in this tragic story which need to be addressed? What is the Truth About Freddie Gray?',1,1430539980000,1367);
INSERT INTO "Podcasts" VALUES(2884,'55478be40868ce2f368bdaaa','How Adolf Hitler Destroyed Germany | George Reisman and Stefan Molyneux','Stefan Molyneux discusses "Why Nazism Was Socialism and Why Socialism Is Totalitarian" with George Reisman and the economic destruction of Adolf Hitler''s totalitarian controlled Germany. | George Reisman is the author of Capitalism: A Treatise on Economics; and is the Professor Emeritus of Economics at Pepperdine University. For more from George Reisman, go to: http://www.capitalism.net | http://georgereismansblog.blogspot.com | https://twitter.com/GGReisman',1,1430752080000,2744);
INSERT INTO "Podcasts" VALUES(2885,'55478c7c0868ce2b368bdee9','Why Nazism Was Socialism and Why Socialism Is Totalitarian','Why Nazism Was Socialism and Why Socialism Is Totalitarian by George Reisman - read by Stefan Molyneux, host of Freedomain Radio. | George Reisman is the author of Capitalism: A Treatise on Economics; and is the Professor Emeritus of Economics at Pepperdine University. For more from George Reisman, go to: http://www.capitalism.net | http://georgereismansblog.blogspot.com | https://twitter.com/GGReisman',1,1430752260000,1941);
INSERT INTO "Podcasts" VALUES(2886,'554925130868ce9b508b4867','Opps. SPLAT! Dead. - Call In Show - May 2nd, 2015','Question 1: Stefan presents varying evidence and statistics to make the claim that it is "best" for men to get married. Why does Stefan present overwhelming evidence of the benefits of marriage but discounts the risks to reach such a broad conclusion? |Question 2: What is masculinity? | Question 3: Freedomain Radio changed my mind about wanting to have children and being a stay-at-home mother – how do I find a great man to be my husband? What do great quality men look for in a woman?',1,1430856840000,12033);
INSERT INTO "Podcasts" VALUES(2887,'5549258a0868ce25368beb19','How To Fight Police Brutality!','It is very tempting to spend one’s anger and outrage on particular manifestations of an unjust system – but all that does is pretend that the rest of the system is somehow just. In magic, this is called “misdirection,” which is the art of drawing the attention of the audience away from the hand actually performing the trick. In the black magic of politics, this is called “the media.” When you cover the air horn blaring of the media circus, the true constellations of political power become immediately visible. Listen on and discover how we truly end police brutality! | Text and Sources: https://board.freedomainradio.com/topic/44069-articlevideopodcast-how-to-fight-police-brutality/',1,1430857020000,1025);
INSERT INTO "Podcasts" VALUES(2888,'554bfbe20868ce2d368bfd6c','Police Ambivalence - Call In Show - May 6th, 2015','Question 1: I live in Baltimore and have experienced the rioting first hand.  I question the Constitutionality of the curfew, but I am at the same time overjoyed at the curfew.  I live in a beautiful but noisy section of town - normally lots of fights outside in the middle of the night.  I’m surprised at how quickly I stepped off my principles to wallow in the short-term gratification of peace and quiet - and a decrease in the likelihood that there would be more property damage. Can you help me understand my ambivalence? | Question 2: How do I deal with the feeling of hopelessness and inferiority that I get from not being able to (directly) positively impact my own outcomes in spite of the fact that I have been able to help many others achieve what I desire? I want to be a good father for my son, and I don’t want him to grow up with this lack of agency as a role model. | Question 3: Many years ago there was a scene in an episode of Futurama where the human race goes extinct because they all chose sex robots that look exactly like celebrities, such as Marilyn Monroe, instead of dating each other and having children. While far-fetched years ago, it seems probable than within less than a decade there might be a thriving sex robot industry. So in the long run, how is marriage and human-to-human sexual relationships going to compete with sex robots?',1,1431042780000,10344);
INSERT INTO "Podcasts" VALUES(2889,'5550938e0868ce2c368c17df','The Burden of Proof | Empathy Edition','Stefan Molyneux looks at the dismissive reaction of many atheists to “The Atheist''s Burden of Proof” video and why it’s important to help people understand - what they simply don’t understand.',1,1431343860000,1326);
INSERT INTO "Podcasts" VALUES(2890,'555094100868ce31558c170a','Horror, History and Heroin | Dr. Gabor Maté and Stefan Molyneux','Stefan Molyneux speaks with Dr. Gabor Maté about a wide range of topics including addiction, stress, empathy and childhood development. Dr. Maté has written several bestselling books including the award-winning In the Realm of Hungry Ghosts: Close Encounters with Addiction; When the Body Says No: The Cost of Hidden Stress; and many more. For more information, go to: http://drgabormate.com/',1,1431344040000,2910);
INSERT INTO "Podcasts" VALUES(2891,'555216f80868ce2d368c24f5','The Hobbit: The Battle of the Five Armies | True Stories ','Is there a hidden story behind The Hobbit Trilogy and Lord of the Rings? Warning: Spoilers! In The Hobbit: The Battle of the Five Armies - having reclaimed Erebor and vast treasure from the dragon Smaug, Thorin Oakenshield (Richard Armitage) sacrifices friendship and honor in seeking the Arkenstone, despite Smaug''s fiery wrath and desperate attempts by the Hobbit Bilbo (Martin Freeman) to make him see reason. Meanwhile, Sauron sends legions of Orcs in a sneak attack upon the Lonely Mountain. As the fate of Middle Earth hangs in the balance, the races of Men, Elves and Dwarves must decide whether to unite and prevail - or all die.',1,1431443100000,605);
INSERT INTO "Podcasts" VALUES(2892,'5555182a0868ce6c1c8bdfe0','Socialism as Pornography - Call In Show - May 9th, 2015','Question 1: My wife wants to divorce me. Is it possible to save our marriage and if not - what should I do to minimize the damage to our son? | Question 2: Is it possible to morally serve in the military, and what should a person do if they have already enlisted? | Question 3: Are we going to see a Bolshevik like attempt in North America, where the race and class resentful left, unable to win the argument using evidence, use violence to get their way?',1,1431639240000,10651);
INSERT INTO "Podcasts" VALUES(2893,'55553faa0868ce2f368c3a24','How to ‘Find Yourself’ - Call In Show - May 13th, 2015','Question 1: My band is working with others musicians and interacting with a manager and label.  What level of intimacy and connection should I have as a standard in order to achieve success? What is your experience of working with others in business?  What made your business relationships successful?  Do you have any advice and tips on working with others in business? | Question 2: What does it mean to "find yourself" and why is it so often associated with being attainable through travel and ‘getting lost?’ | Question 3: I’m a single father of a young daughter and am interested in dating again. While I know how to date I have no idea how to appropriately filter my daughter’s insight into my dating life - do you have any suggestions? I’m also concerned about the type of woman that would be interested in dating a single father. Does a single father have any chance of finding a ‘good woman’ when the single mothers in my extended social web seem to only find jerks?',1,1431649800000,9119);
INSERT INTO "Podcasts" VALUES(2894,'55561c7c0868ce2a6e8b74a7','The Truth About David Letterman','David Letterman has been involved in the entertainment industry for over forty years and tends to be a very divisive figure. Some people loved the affable everyman who caustically poked holes in the facade of celebrity, while others found Letterman to be mean-spirited and aggressive. What isn’t up for debate is the sizable role he’s played within American culture over the course of multiple decades. Whether you’re a fan or not, everybody knows the name David Letterman and his sarcastic wit has left an imprint on generations of observers. A deeply private man, Letterman’s relationship with his own celebrity and success is as complicated as it is fascinating. At many points in his career it seemed the only thing Letterman feared more than outright failure were the consequences and pressure of his own achievements. For a man who often took the wind out of pompous, egotistical celebrities – who dared to take themselves too seriously – Letterman was a workaholic, nearly obsessed with achieving perfection in his performances, and left a trail of broken relationships in his wake. Subjective opinions abound, but what is The Truth About David Letterman? | Sources: http://www.fdrurl.com/david-letterman',1,1431706440000,8903);
INSERT INTO "Podcasts" VALUES(2895,'555a31680868ce6c1c8bff91','Judgment as Violence - Call In Show - May 16th, 2015','Question 1: Is Non-Violent Communication Universally Preferable Behavior? | Question 2: I am feeling stuck. It’s been about two years since my significant other left. We have two children, one who is an adult and on her own and one who lives with me. After finding you, I began to peaceful parent for the last year and a half. The problem I am having is determining what to do when my needs and my child’s needs are in conflict. I am trying to heal myself and prevent as much damage as I can to my child. How do I determine when the benefit of my long term well-being overrides her short term needs for her long term benefits?',1,1431974100000,5153);
INSERT INTO "Podcasts" VALUES(2896,'555b56a90868ce37368c647f','The Truth About George Washington','George Washington was unanimously elected as the first president of the United States of America after winning the American Revolutionary War as the Commander-in-Chief of the Continental Army.
INSERT INTO "Podcasts" VALUES(2897,'555e44f00868ce9a508bd6b1','Subjective is Objective? - Call In Show - May 20th, 2015','Question 1: Is the subjective theory of value a valid claim? | Question 2: If your significant other begins to fail to meet your rational standards in a relationship, is it worth it to try to change them back? What is the best way to go about doing this and what level of responsibility do we have in imposing rational standards on the ones we care deeply about? Or - is this all too demanding/controlling?',1,1432241160000,9210);
INSERT INTO "Podcasts" VALUES(2898,'555f6d450868ce9d2a8bfbad','What The Media Won''t Tell You!','How is it possible to be positive and enthusiastic given all of the bad news around the world? Stefan Molyneux looks at some of the incredibly positive news and trends which show ways the world is getting better. Includes a look at: violent crime, assault, property crime, gun crime, violence against children, life expectancy, infant mortality and much much more!',1,1432317120000,1175);
INSERT INTO "Podcasts" VALUES(2899,'556258d20868ce41368c9262','Unobtanium, One World Government and The Moon - Call In Show - May 23rd, 2015','Introduction: The Problem with Nature Documentaries | Question 1: In committed relationships, physical cheating is obviously a no-go, but other things like ''flirting with the opposite sex'' can exist in a grey area. How can one rationally delineate boundaries in romantic relationships? | Question 2: Raising children with violence actually releases chemicals causing apoptotic cell death in the active areas of the brain during violent incidents, similar to forming a logic gate in a silicon structure of a computer. Isn’t this smoking gun evidence proving that one should follow the non-aggression principle? | Question 3: I am having trouble finding a definition of property that would explain ownership of finite things that are not products of a person''s labor. The definition that I have heard provided by Stefan is "property is something that is created," and I agree with this statement, but I am not sure that it explains how something that was not produced by a person can be exclusively used by that person.',1,1432508400000,8331);
INSERT INTO "Podcasts" VALUES(2900,'55648a970868cef40d8b52cf','What You Didn''t Know About IQ | Dr. Kevin M. Beaver and Stefan Molyneux','Criminology expert Dr. Kevin M. Beaver and Stefan Molyneux discuss the impact of parenting on child intelligence, the predictable capabilities of IQ, the evolutionary behavioral genetics of violent crime and possible explanations for the massive drop in criminality. Dr. Kevin M. Beaver is an expert on biosocial criminology, which explores the biological and environmental factors involved in crime and antisocial behavior.',1,1432652160000,2292);
INSERT INTO "Podcasts" VALUES(2901,'556549f20868ce7e708b5789','Unchosen Positive Obligations: The Self-Sacrifice of Subsidy','Why are people so hostile to the idea of a free society? Are people really angry about how roads will be hypothetically built centuries from now? Stefan Molyneux discusses the reality of unchosen positive obligations, the self-sacrifice of subsidy and the origin of hostility to voluntary interactions.',1,1432701240000,1674);
INSERT INTO "Podcasts" VALUES(2902,'5566c2cd0868cef70d8b62e9','The Truth About Male Privilege ','Male Privilege is a term for social, economic, and political advantages or rights that are made available to men solely on the basis of their sex. Feminists tend to believe that they are living under patriarchy - where men hold the power and women are unfairly exploited. Stefan Molyneux looks at the statistics and data in an attempt to answer the question - what is The Truth About Male Privilege? | Sources: http://www.fdrurl.com/male-privilege',1,1432797300000,5246);
INSERT INTO "Podcasts" VALUES(2903,'55683e5b0868ce7e708b69ea','The Biology of White Knighting - Call In Show - May 27th, 2015','Question 1: I am having difficulty understanding how we can remove the concept of the State from a society which practices the concept of property ownership. Aren''t States, at least in the traditional sense of monarchs and limited republics, nothing more than one or a group of human property owners collectivizing their efforts to defend property from natural forces? | Question 2: My wife is the definition of a keeper, but I’ve completely friend-zoned her. Is just a friendship good enough for a long-lasting romantic relationship? Is such a relationship a good ground for raising healthy children? Or is there a way to reignite the feeling? | Question 3: My daughter recently turned four. I know that someday soon I will need to address the concept of government and all of the joys that come along with it: coercion and war. How do I introduce the state to my young daughter, without glorifying it or traumatizing her?',1,1432894800000,9453);
INSERT INTO "Podcasts" VALUES(2904,'556849850868cef30d8b6d17','Government Mandated Circumcision! | True News','After 1½ years of fighting against the mutilation, Heather Hironimus was jailed after she fled to protect Chase Nebus-Hironimus from a court order demanding that he be circumcised.  Jailed since May 14th for defying a judge''s custody order and refusing to let her son be circumcised - Hironimus gave her consent - under duress - to the procedure wanted by the boy''s dad, Dennis Nebus. Heather Hironimus is now charged with interference of custody, a third-degree felony, from her months of hiding with the boy in a local domestic violence shelter. | Stefan Molyneux speaks with Georganne Chapin from Intact America about the trends in circumcision, the myth of its medical necessity, the tragic Heather Hironimus case and what can be done to end this barbaric practice in the world today. | Georganne Chapin is the executive director of Intact America and the Secretary of Attorneys for the Rights of the Child. For more go to: http://www.intactamerica.org and https://www.facebook.com/intactamerica',1,1432897860000,2133);
INSERT INTO "Podcasts" VALUES(2905,'556b7c7f8ead0ec50b8b5137','An Introduction to Capitalism','An entertaining introductory look at capitalism, property rights, the redistribution of “wealth” and inequality within society. Private ownership of the means of production is the consistent application of property rights within society.',1,1433105640000,1945);
INSERT INTO "Podcasts" VALUES(2906,'556c1a3f8ead0ec1098b5557','Passive-Aggressive Communication - Call In Show - May 30th, 2015','Question 1: How can you demonstrate the power of psychology to someone who views it as nothing more than superstition - like believing in a deity? Isn''t it true that to ‘outsiders,’ therapy and learning to trust your emotions is not that different from what religious people call faith? | Question 2: During the May 16th show, Judgment as Violence, you proposed several criticisms of the late Marshall Rosenberg''s guidelines for achieving what he labeled, Nonviolent Communication, that I found to be quite troubling. I believe there are several logical errors in your explanation that concern me, but ignoring them, I have two main questions.  Why is it that all communication must be seen as nonviolent?  How can verbal abuse be nonviolent? |Question 3: Is it moral to have children when you''re either physically and/or mentally ill?',1,1433147820000,13805);
INSERT INTO "Podcasts" VALUES(2907,'556ed0278ead0e1d6a8b499f','Bill and Hillary Clinton: Merchants of Power | True News ','Amidst the media storm surrounding Hillary Clinton''s presidential bid, Stefan Molyneux identifies the larger patterns within the Clinton Cash/Clinton Foundation controversy. Are the Clintons corrupt? What does their questionable behavior say about politics as a whole? Learn about the practice of selling power in this latest installment of True News.',1,1433325540000,1290);
INSERT INTO "Podcasts" VALUES(2908,'556fb99b8ead0e0b6a8b518f','The TSA''s 95 Percent Failure Rate | True News','Recently, the Department of Homeland Security decided to test the effectiveness of the Transportation Security Administration (TSA) by conducting a series of undercover tests. The results were quite shocking. Investigators were able to smuggle mock explosive and banned weapons in 67 out of 70 attempts. That''s a failure rate of 95 percent!',1,1433385240000,426);
INSERT INTO "Podcasts" VALUES(2909,'556fba1f8ead0e216a8b5067','The USA Freedom Act | True News','On June 2, 2015, Obama signed into law the USA Freedom Act, which as an acronym for Uniting and Strengthening America by Fulfilling Rights and Ending Eavesdropping, Dragnet-collection and Online Monitoring Act. What a delightful name! The USA Freedom Act!',1,1433385360000,431);
INSERT INTO "Podcasts" VALUES(2910,'557058848ead0e9e278b6977','Does Men’s Rights Ruin Relationships? - Call In Show - June 3rd, 2015','Question 1: I had a messy break-up with my girlfriend of 3 years - for both of us this was our first love. I fear that perhaps my research into Men''s Rights has caused me to be hyper critical of her - can Men''s Rights ruin loving relationships? | Question 2: My life feels like a ping-pong game between impatience and boredom. Whenever I have something to do, like working or visiting family, I get impatient and find myself yearning for alone time. Whenever I have some alone time, I find myself bored, unmotivated and yearning for something to do. How can I break this cycle of dissatisfaction and enjoy each of life''s situations for what they are worth? | Question 3: What is our responsibility to our elders as adults?',1,1433425680000,14608);
INSERT INTO "Podcasts" VALUES(2911,'5572f72e8ead0efd0d8b81d1','The Myth of Small Government ','If there was a government which provided a standing military (only for defense) and a basic court of law - would you support such a government? Stefan Molyneux examines the myth of small government.',1,1433597640000,1466);
INSERT INTO "Podcasts" VALUES(2912,'557452e68ead0ed2118b8667','Incomprehensible Bravery - Call In Show - June 6th, 2015','Question 1: How do you know when you''re “done” with therapy? I escaped a fundamentalist religious cult and have a hard time being passionate about the next stage of my life - do you have any suggestions? | Question 2: A listener reads a letter detailing how his older son found the show and convinced his younger son from pursuing his military career. | Question 3: I''m currently a resident physician in Emergency Medicine. This profession requires deductive reasoning, a rational approach to problems, and critical thinking to successfully treat patients. However, it has become increasingly clear that a great number of people who share my profession do not seem to follow these aspects of thinking when it comes to other issues. Why do you think this occurs in people who have devoted their life to something that requires one to be logical and rational?',1,1433686560000,11358);
INSERT INTO "Podcasts" VALUES(2913,'5575b3d18ead0e136a8b737f','WAR | What They Won''t Tell You! ','It has been often said that war is the health of the state - but the argument could also be made that the reverse is more true: that the state is the health of war. In other words, that war - the greatest of all human evils - is impossible without the state. Article: http://www.fdrurl.com/warhealth',1,1433776980000,1342);
INSERT INTO "Podcasts" VALUES(2914,'55774e128ead0e6a168b95bf','Impacting Intelligence (IQ) | Stefan Molyneux and Hank Pellissier ','Stefan Molyneux and Hank Pellissier discuss Intelligence including ways in which human intelligence can be decreased by chosen behavior. Why is the IQ of Ashkenazi Jews so high compared to the general population? What religious tradition has had a fascinating dysgenic impact on intelligence? Should college education be free? Hank Pellissier is a humanitarian writer, editor, speaker and producer, especially on futurist and transhumanist topics. He’s the author of several books including "Brighter Brains: 225 Ways to Elevate or Injure IQ" and "Why is the IQ of Ashkenazi Jews so High?"',1,1433881980000,3024);
INSERT INTO "Podcasts" VALUES(2915,'5578dd268ead0e216a8b8920','A Brief History of Tomorrow','How did we get to where are today? How did we get to economic stagnation, the slow strangulation of liberties? How did we get to where we will be tomorrow, with economic collapse and the war of words of all against all? Here is a very rapid tour through the destruction of rationality.',1,1433983920000,952);
INSERT INTO "Podcasts" VALUES(2916,'5579b9638ead0e176a8b8e2f','The Horror of Depression - Call In Show - June 10th, 2015','Question 1: In a world overrun by a lack of self-knowledge who holds responsibility in ensuring people at high risk of mental illness seek treatment before they raise children? | Question 2: I think my self-doubt comes from the conclusion I reached recently that my parents are not intelligent. I believe that intelligence is genetic since I am a product of my parents I see myself as unintelligent also. If my success depends on my genetics, something which I have no control over then I believe somehow, that I am destined to lead an unhappy life. What are the origins of self-doubt? And how we can overcome negative beliefs? | Question 3: Does not having kids change what you ultimately look for in a partner? Is it now less about good parenting ability and more about enjoyment and self-development?',1,1434039240000,14264);
INSERT INTO "Podcasts" VALUES(2917,'557c650d8ead0e30338b460f','Jurassic World: The Untold Story! | Movie Review','An in-depth look at the blockbuster movie "Jurassic World" with Stefan Molyneux. Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park. After 10 years of operation and visitor rates declining, a new attraction is created to re-spark interest and goes horribly wrong!',1,1434215400000,4406);
INSERT INTO "Podcasts" VALUES(2918,'558381578ead0e31338b78d1','Supernatural Death Threat Terrorism - Call In Show - June 13th, 2015','What are the effects of religious leaders convincing their members the end is near - possibly within their lifetime? Do Jehovah Witnesses and other religious organizations use propaganda to create prejudice against non-believers?',1,1434681660000,6169);
INSERT INTO "Podcasts" VALUES(2919,'5584f6958ead0e2c338b8820','The Salvation of Greece. Prepare Yourself Accordingly.','Financial instability has caused a massive bank run in Greece which has resulted in billions of Euros in cash being withdrawn as of Friday night. Despite maneuvering from the Greek Central Bank, the European Central Bank and those in the European Union -  this situation is completely unsustainable. So what''s next? What can be done in the event of economic collapse to allow Greece a sustainable future? Will Greece stay stick with the Euro?  Will Greece leave the European Union?',1,1434777120000,1470);
INSERT INTO "Podcasts" VALUES(2920,'558382b38ead0e30338b7a18','The 97% Consensus? Global Warming Unmasked!','It’s been claimed that ninety-seven percent of scientists agree: climate change is real, man-made and incredibly dangerous. But where does this ninety-seven percent claim come from, and more importantly - is it true? The claim is taken from a paper by Australian John Cook, Climate Communications Fellow for the Global change Institute at the University of Queensland. However, the paper says nothing about the would-be dangers of climate change and it only counts the number of publications, rather than the number of scientists, in support of human-made climate change. Never let facts get in the way of a good story.',1,1434779160000,1998);
INSERT INTO "Podcasts" VALUES(2921,'558383a98ead0efa108b54b7','Dylann Roof: Charleston Church Shooting | True News','Nine people are dead after shooting which occurred 9pm on Wednesday at the Emanuel African Methodist Episcopal Church in Charleston, South Carolina. The congregation, established in 1816, is one of the oldest African American churches in the United States.
INSERT INTO "Podcasts" VALUES(2922,'5587ffe98ead0e0f778b91a7','The Truth About Dylann Roof | Charleston Church Shooting','Nine people are dead after a shooting that occurred on Wednesday at the Emanuel African Methodist Episcopal Church in Charleston, South Carolina. The congregation, established in 1816, is one of the oldest African American churches in the United States.
INSERT INTO "Podcasts" VALUES(2923,'5588507d8ead0efa108b77da','Pickup Artists, Hypergamy and Ostracism - Call In Show - June 17th, 2015','Question 1: When is a good time to change someone’s mind? We live in a society where I feel that most people don''t want to argue with each other - because both sides know that they are not prepared enough or have enough time to convince another person - or are in a too awkward place to argue. Can you balance the coexistence and friendship with arguing and debate? | Question 2: The caller wrote, “Ostracizing someone for moral reasons doesn''t harm the person doing the ostracism, but ostracizing someone for aesthetic reasons absolutely harms the person doing the ostracism.”  Does Stefan''s refusal to endorse (or embrace) hypergamy and his encouragement to ostracize people who defend and/or engage in hypergamous behavior cause great harm to his audience?',1,1434996720000,12905);
INSERT INTO "Podcasts" VALUES(2924,'55895cb48ead0efb798b47f7','Do You Hate The World? | #RageQuitEarth','Listener Question: "The world is not exactly chock full of people who are voluntarist, who''ve got self-knowledge, people who''ve been to therapy, people who have good relationships, people who reject the state and the initiation of force." Nor will it ever be, not even close.  And therein lies the fundamental flaw in your brand of philosophy.  Your ideal society requires for the average human a minimum threshold of intelligence and morality that cannot be met. I find many things you teach very useful on a micro level and they will help many individuals in their quality of life and their relationships, but the debate about extending them to a large enough population to change our societal structure is moot."',1,1435065360000,1349);
INSERT INTO "Podcasts" VALUES(2925,'558ae3f88ead0e002d8b4627','My Dylann Roof Dream | How to Stop Mass Shootings','In the aftermath of the Charleston Church Shooting by Dylann Roof - something just didn''t feel right. Then last night, I had the strangest dream which helped put things into perspective.',1,1435165500000,2071);
INSERT INTO "Podcasts" VALUES(2926,'558b23908ead0e037a8b57e7','Eternal Human Consciousness? - Call In Show - June 20th, 2015','Question: My personal belief in this existence is that the human soul or consciousness, is part of a higher dimensional source which is the source of all energy in the world, and that when we die, we are simply reborn as another person/intelligent being. I would like to know what Stefan thinks (in both a literal and philosophical sense) of the idea that all consciousness is one and the same - and in the end it is what we return to when we die and what sends us back to rebirth.',1,1435181940000,5905);
INSERT INTO "Podcasts" VALUES(2927,'558c5fde8ead0e042d8b5207','An Introduction to Reality ','A brief introduction to reality using a rational methodology. How does one use sense data to conceptualize reality? How is reason derived from evidence? What are concepts and how can we understand them? How do we understand ethics and morality? How does this apply to the world and culture?',1,1435262880000,1923);
INSERT INTO "Podcasts" VALUES(2928,'558cea918ead0e047a8b632f','Anti-Human Propaganda - Call In Show - June 24th, 2015','Question 1: Since nature is connected in a huge ecosystem, how can you be the one to decide what to do with your property if what happens on it will affect everyone? | Question 2: We haven’t done one of these in a while - Stefan analyzes a caller’s dream to see if the unconscious metaphor generator makes any sense when compared to his real world predicament and challenges. An incredibly interesting example of the power of the unconscious mind! | Question 3: There is a disconnect between my inner and outer life. I am very empathetic and I feel deeply about a great many things, but I avoid stress in any form to the point of disassociation and I am very fearful of negative reactions and consequences. I want to stop being dishonest and evasive but I don''t want to make any harmful mistakes. I have come to understand that I am somewhat emotionally inept.  What are some steps that I can take in order to grow an emotional backbone?',1,1435298280000,12130);
INSERT INTO "Podcasts" VALUES(2929,'5591a5768ead0e6f0e8b80df','The Truth About Gene Wars: r/K Selection Theory ','Occasionally new information completely blow your mind -  and this is one of those times! Stefan Molyneux breaks down the basics of the genetic warfare which is the foundation of all living creatures. Different reproduction strategies have emerged over time and this is explained through r/K Selection Theory. When you look at humanity through the lens of reproduction strategies - it''s something you can never, and will never, be able to unsee!',1,1435608180000,3359);
INSERT INTO "Podcasts" VALUES(2930,'5592ef358ead0e082d8b7e12','What Pisses Me Off About The Confederate Flag','The suspect in the Charleston shooting, Dylann Storm Roof, appeared in a number of photographs with the Confederate flag - prompting calls for banning of the flag nationwide as a symbol of racism and hatred. As lawmakers and business respond to the public outcry, Stefan Molyneux looks at the reality of the situation, and breaks down what’s said – and what’s not being said.',1,1435692720000,1057);
INSERT INTO "Podcasts" VALUES(2931,'5595f7558ead0e022d8b95e7','Death by the Drug of Money: Greece, Europe, America and You','Greece has become the first industrialized nation to default on its IMF payments, and the first since Zimbabwe in 2001. Here is the essential information you need to know about fear currency, infinite debt, bank thefts and the dangers of a delusional population.',1,1435891140000,1001);
INSERT INTO "Podcasts" VALUES(2932,'5596461e8ead0e147a8ba4fa','Babies Are Racist - Call In Show - June 27th, 2015','Question 1: When it comes to property ownership - what is the difference between a government and a landlord? | Question 2: If all United Nations member countries removed all work and residency restrictions - this would force nations to quickly create great living and working conditions for their citizens or lose their tax base. This way all nations will improve themselves through competition -principles of the free market applied to dominions. My theory is that ultimately the number of countries would probably drop but a more equitable united world would emerge. So my question is, why isn''t this done currently? | Question 3: I plan on entering the dating world in the near future but am afraid that I don''t represent value to anybody. Do I need to alter myself to have value or do I wait for someone to find value in me?',1,1435911540000,13422);
INSERT INTO "Podcasts" VALUES(2933,'559704568ead0e1d7a8baee9','The Fall of Puerto Rico. Prepare Yourself Accordingly.','Puerto Rico’s economy is in a death spiral and it could threaten the entire United States bond market. How did we get to this point and what does this mean in the big picture? Stefan Molyneux breaks down the unspoken facts about the end of freedom, opportunity, employment and trade in modern Puerto Rico. An in depth explanation about what this means for the average Puerto Rican and Americans overall – spoiler, it’s not good! There will be no economic recovery, prepare yourself accordingly. Sources: http:/www.fdrurl.com/puerto-rico',1,1435960200000,2627);
INSERT INTO "Podcasts" VALUES(2934,'559902c18ead0e002d8ba6e2','The Caller Who Doesn’t Exist - Call In Show - July 3rd, 2015','Question 1: In reference to the Mouse Utopian Experiments by John Calhoun - I believe that mammals must always have something to strive for or else they lose the will to live.  Do you think that the belief in finite horizons is a subconscious kill switch, poisonous to the will to live? | Question 2: I feel a very strong sense of apathy in just about every aspect of my life. I hide this behind a false sense of cheerfulness in the face of strangers, and push those very few who are close to me away when they see the state that I am in. How do I make changes when I feel huge lack of interest or passion for much of anything, nor much desire to do the incredible work necessary to heal my emotional wounds?" | Question 3: You dogmatically cling to a belief in Atheism but do not ascribe it the equal responsibility of proving that God doesn''t exist, rather than simply admitting you don''t know. How can you dismiss with any kind of certainty that religion neither holds value nor truth?',1,1436090940000,9961);
INSERT INTO "Podcasts" VALUES(2935,'559b200f8ead0ec37a8b63df','Greek Referendum: Their Yesterday, Our Tomorrow | True News','No! The resounding answer to the Greek Referendum where 61 percent voted against further austerity in exchange for financial help from Europe and the International Monetary Fund. The vote could lead to the country''s exit from the eurozone within weeks. 
INSERT INTO "Podcasts" VALUES(2936,'559c32668ead0e1d7a8bd09a','What Science Is Telling Us About Fathers | Paul Raeburn and Stefan Molyneux ','GET THE BOOK: http://www.fdrurl.com/paul-raeburn | ‘Do Fathers Matter: What Science Is Telling Us About the Parent We’ve Overlooked’ looks at the latest research in psychology, neuroscience, genetics, anthropology, medicine, and sociology to explore the role of fathers in today’s families. Stefan Molyneux speaks with author Paul Raeburn on the overlooked, but incredibly important role that a father has in the healthy development of his children. | Paul Raeburn is the author of Do Fathers Matter? What Science Is Telling Us About the Parent We’ve Overlooked. Raeburn writes the About Fathers blog for Psychology Today and is the chief media critic for the Knight Science Journalism Tracker at MIT. He contributes to The New York Times, Discover, Scientific American and The Huffington Post. For more, go to: http://www.paulraeburn.com',1,1436299740000,3458);
INSERT INTO "Podcasts" VALUES(2937,'559ce2738ead0e6f0e8bd090','The Voices of the Voiceless - Call In Show - July 4th, 2015','Question 1: How honest should I be with my young kids when it comes to big issues like drugs - while trying to maintain their innocence? I''m afraid to lay the hammer of reality down on them too much or soon but at the same time don''t want them to be ignorant of the world. | Question 2: My young son can be temperamental and aggressive at times - how can I get him to calm down and listen when he gets upset?',1,1436344800000,10295);
INSERT INTO "Podcasts" VALUES(2938,'559cffa68ead0e6f0e8bd141','The Genetics of Politics | Liberals vs. Conservatives | Gene Wars [Part 2}','An examination of the biological and genetic basis for political ideologies: Do genetics determine if you’re a liberal or conservative?  What role does r/K selection theory play in the world where we live?  How big is your amygdala - and what does that mean about your possible political perspective? Includes a look at the Prefrontal Cortex, Anterior Cingulate Cortex and the impact of dopamine in the realm of political biology.',1,1436351700000,4340);
INSERT INTO "Podcasts" VALUES(2939,'559eb26f8ead0eff3a8ba610','The Myth of Passive Victimhood - Call In Show - July 8th, 2015','Question 1: My sister is emotionally dependent on me due to her mental disabilities and a recent family tragedy. My wife feels like my priorities have shifted towards my sister; thus not giving her the attention she needs. How can I strike a balance between these two worlds without also compromising my sanity? | Question 2: How can I talk with my future children about religion? How can I learn to communicate with them without losing my temper, threatening them or raising my voice like my parents did to me? | Question 3: How important do you think communication is in a healthy relationship? If you meet a good girl who is virtuous and has good morals but has poor English and communication skills do you think that the relationship can work?',1,1436463420000,12410);
INSERT INTO "Podcasts" VALUES(2940,'559f037a8ead0e062d8bd5a7','The Fall of China: There Will Be No Economic Recovery.','China just lost over $3 trillion of stock value, what this means to you, your house, your money, your future and your chances for true economic and political freedom.
INSERT INTO "Podcasts" VALUES(2941,'55a13d3c8ead0ed37a8b8c77','Who Will Pay? Austerity vs. Bailouts | Greece, Europe and The Euro!','When debt consumes a country and its financial system collapses - who will pay? Who will be held responsible for the bad decisions, the debt and the malinvestment? 
INSERT INTO "Podcasts" VALUES(2942,'55a4620a8ead0edc7a8ba289','The Role of Men as Providers - Call In Show - July 11th, 2015','Question 1: I’m a former entrepreneur who is currently a stay at home father while my wife earns a living. I’m feeling increasingly frustrated, am generally unhappy and my self-confidence has fallen to the point where I don’t know if I could run a successful business even if the opportunity presented itself. Do you have any thoughts on my wife and I can improve my happiness? | Question 2: I was fired from my job of nine years and since then I''ve been going from one low paying entry-level job to another.  I have a useless degree, recently turned thirty and I feel like I''m stuck.  How can I improve my situation? | Question 3: Given that socially funded research is demonstrably the best method for advancing technology and technology is the leading factor in improving the overall standard of living, how could removing the state not be viewed as detrimental to the progression of mankind? | Question 4: I recently started dating a women who I think will be a good parent for various reasons, but I ran into some potential red flags that I think may become problematic during post-child rearing phase of life. What do you think is a good approach for drawing the line between satisfying own desires vs. satisfying the evolutionary biological imperative of creating more smarter and peaceful generation of kids?',1,1436836080000,13063);
INSERT INTO "Podcasts" VALUES(2943,'55a6fa138ead0edc7a8bb5d2','The Truth About The Euro. Prepare Yourself Accordingly.','Over the years, the general public has been told many false reasons as to why the Euro was necessary. Everything from economic stability - to preventing World War III has been used as justification for the European currency’s existence. In light of the economic crisis in Greece, we strive to answer: What is the truth about the Euro and the European Central Bank? Sources: http://www.fdrurl.com/truth-about-the-euro',1,1437006060000,4681);
INSERT INTO "Podcasts" VALUES(2944,'54d10fc80868ce23778b5ca7','The Truth About Dalai Lama','Dalai Lama is a title given to the leader and high priest of the Yellow Hat sect of Tibetan Buddhism, who is considered to be the incarnation of the bodhisattva - a human being who has achieved an "enlightened" state - of compassion. Tenzin Gyatso, the main subject of this presentation, is the 14th Dalai Lama and is thought of as a reincarnation of his predecessor - the 13th. Buddhism originated from the Buddha, a prince in northeastern India, who abandoned the ruling class in search of a way to end the cycle of reincarnation - which was a core principle in Indian hinduism - and thus overcome human suffering. What is the truth about Dalai Lama? Sources: http://www.fdrurl.com/dalai-lama',1,1422987060000,4123);
INSERT INTO "Podcasts" VALUES(2945,'54d283580868ce24778b66f7','There Are No Solutions','Stefan Molyneux explains why there are no solutions. Freedomain Radio is 100% funded by viewers like you. Please support the show by signing up for a monthly subscription or making a one time donation at: http://www.fdrurl.com/donate',1,1423081620000,1159);
INSERT INTO "Podcasts" VALUES(2946,'54d3a0250868ce34778b6d69','What Pisses Me Off About Greece''s Debt Crisis','Did you know: 80% of the bailout money went to European Union banks that were Greek bondholders, and not the Greek economy. The Syriza party and its leader Alex Tsipras won last month''s general election in Greece with a pledge to write off half of Greece''s debt New Finance Minister Yanis Varoufakis said "too much time, hopes, lives" had been wasted by Greece''s forced austerity program. Stefan Molyneux discussed the Greece debt crisis, the role of the banks in creating this mess, the possibility of an outright default, the danger of derivatives, the destruction of the euro and how a Greece default could set off a global economic meltdown.',1,1423155060000,755);
INSERT INTO "Podcasts" VALUES(2947,'54d4434d0868ce23778b73ba','Landing The Planet - Wednesday Call In Show - February 4th, 2015','What happened when Miss Universe was asked - what can women learn from men? How many kids is too many? How long can a family reasonably home school? Regarding balancing children and career advancement - is it worth working 50 hour weeks given the lost time with children? When we say "to not murder" is Universally Preferable Behavior, do we imply the following “If you want to be virtuous, you should not murder"? Do you think there is a ''war'' on white people? What would narrative stories look like in a free and peaceful society?',1,1423196820000,9455);
INSERT INTO "Podcasts" VALUES(2948,'54d6787a0868ce29778b83a9','The Complexity of Abortion','Pro-Life? Pro-Choice? Stefan Molyneux discusses the complexity around the subject of abortion. Freedomain Radio is 100% funded by viewers like you. Please support the show by signing up for a monthly subscription or making a one time donation at: http://www.freedomainradio.com/donate',1,1423341480000,1811);
INSERT INTO "Podcasts" VALUES(2949,'54d7c1260868ce36778b8987','Extraordinary Claims Require Extraordinary Evidence - Saturday Call In Show - February 7th, 2015','Is it possible to simplify the argument for universal ethics? Do most parents really love and care about their children like they say? If so, how can 80%-90% of them reconcile hitting them? Does Objectivism - as formulated by Rand and Branden - tend to over-inflate the human ego in an unhealthy way? Is the Objectivist view of self-esteem unhealthy and absolutistic? Why are 18th and 19th century writers like Nietzsche and Schopenhauer considered philosophers since their claims aren’t falsifiable?',1,1423425600000,12277);
INSERT INTO "Podcasts" VALUES(2950,'54da32d30868ce42548b87e9','The Climate Change Solution No One Will Talk About ','How do we end the emotionally charged division around the subject of Catastrophic Anthropogenic Global Warming? What is the Climate Change solution that nobody is talking about? What factors are overlooked when it comes to reducing waste and eliminating damage to the environment?',1,1423585920000,650);
INSERT INTO "Podcasts" VALUES(2951,'54db99630868ce24778ba4aa','Gay Marriage: What Nobody Talks About! ','A special look at marriage and the continuing controversy around same-sex marriages around the world. What is the purpose of marriage historically? What are the solutions moving forward?',1,1423677780000,989);
INSERT INTO "Podcasts" VALUES(2952,'54dcdd470868ce27778bab77','What Fifty Shades of Grey Readers Have In Common ','What do readers of Fifty Shades of Grey have in common? A recent study showed strong correlations between health risks in women''s lives - including violence victimization - and consumption of Fifty Shades of Grey material. Stefan Molyneux speaks with Dr. Amy Bonomi about the study''s findings and what can be learned from the popularity of Fifty Shades of Grey.
INSERT INTO "Podcasts" VALUES(2953,'54dd18af0868ce22778baf11','Should You Go To College?','Stefan Molyneux takes a look at the many things that one should consider when making a decision about higher education. Freedomain Radio is 100% funded by viewers like you. Please support the show by signing up for a monthly subscription or making a one time donation at: http://www.fdrurl.com/donate',1,1423775880000,2305);
INSERT INTO "Podcasts" VALUES(2954,'54de81040868ce3a778bb8f1','The Inertia of Human Personality - Wednesday Call In Show - February 11th, 2015','My husband and I are peaceful parents to a six year old boy, but we are at odds about how to deal with our son not taking our discussions to heart. Is an emotional reaction necessary for children to understand? What are reasonable expectations for a six year old? Previously you’ve suggested that people think of the world as a whole – and not just personal happiness - when choosing a career. How does this mesh with the objective belief that altruism is not a virtue?',1,1423867680000,7805);
INSERT INTO "Podcasts" VALUES(2955,'54de81cb0868ce3a778bb8fa','P!nk Would "Rather Go Naked"','P!nk recently teamed up with PETA (People for the Ethical Treatment of Animals) to create an advertisement and join a long list of celebrities who''d "rather go naked than wear fur." While one can certainly understand her concerns about animal treatment - something she''s said in the past makes this a bit confusing.',1,1423868280000,299);
INSERT INTO "Podcasts" VALUES(2956,'54df700d0868ce23778bbfbd','Fifty Shades of Grey: The Untold Story','Stefan Molyneux analyses the phenomenon that is Fifty Shades of Grey. Both the books and the film offer a disturbing yet fascinating view of the often hidden dynamics that underlie female sexuality, intimate partner violence, and a multitude of taboo subjects. What can we learn and what should we discard? You can find the answers in Stefan Molyneux''s review of Fifty Shades of Grey!',1,1423929240000,4000);
INSERT INTO "Podcasts" VALUES(2957,'54e151de0868ce34778bcc1f','Will Artificial Intelligence Kill Us All? - Saturday Call In Show - February 14th, 2015','What do Fifty Shades of Grey and Passion of the Christ have in common? The technology community is in agreement that Artificial Super Intelligence is an inevitability. Timelines range from 15 years to the end of the century and projected outcomes are polarized: human extinction or human immortality. Do you think ethics could be programmed into AIs to keep them safe in the event they become Super Intelligent? I’ve been in a romantic relationship for seven years and I’m not happy - how do you know whether to stay or leave? What do you think is the freest country in the world?  With so many countries moving farther away from a free society, what countries do you think are moving in the right direction toward freedom?',1,1424052480000,10147);
INSERT INTO "Podcasts" VALUES(2958,'54e6185e0868ce3a778bee6b','The Inevitability of Economic Collapse - A Conversation with G. Edward Griffin ','Stefan Molyneux and G. Edward Griffin look at the central banking scam, the crisis in Greece, the inevitability of economic collapse, the possible collapse of the Euro, widespread panic in the Eurozone, Gold as a historical store of financial value, the practical impossibility of solving the problems in Greece and fiat currency withdrawals.
INSERT INTO "Podcasts" VALUES(2959,'54e643510868ce25778bf371','The Power of Sexuality - Wednesday Call In Show - February 18th, 2015 ','An incredible look into relationships and dating with two powerful conversations. In ‘The Philosophy of Forgiveness’ it is said that for every bad moment it takes ten good ones to make up for it. How is it possible to repair a relationship if this positive to negative ratio is already messed up? I was recently dumped by my boyfriend of two years after he reconnected with an ex-girlfriend.  Is it possible that men who feel inadequate or unworthy in a relationship will downgrade or sabotage relationships with ideal mates in order to feel more adequate or powerful with more dependent women?',1,1424376420000,10856);
INSERT INTO "Podcasts" VALUES(2960,'54e766aa0868ce91328bb730','Get Hired Now! | Get The Job That You Want ','Job interviewing never seems to get easier - but Stefan Molyneux provides some essential tips and perspective to help you get the job that you want. Get hired now!',1,1424451120000,1061);
INSERT INTO "Podcasts" VALUES(2961,'54e8bf310868cefb6b8b4caf','Democricide | Why Democracy Always Fails ','Stefan Molyneux explains why democracy always fails - and will always fail. Freedomain Radio is 100% funded by viewers like you. Please support the show by signing up for a monthly subscription or making a one time donation at: http://www.fdrurl.com/donate',1,1424539320000,1341);
INSERT INTO "Podcasts" VALUES(2962,'54eb9e350868ce3a778c142c','If Slaughterhouses Had Glass Walls - Saturday Call In Show - February 21st, 2015','Does it violate the non-aggression principle to not be a vegan? Why are virtuous individuals drawn to religion when the bible has so many contradictions and depictions horrendous acts? Isn''t marriage simply a monopoly on your partner''s choices? Why is it that many creative people involved in collegiate arts (film/theater) are incredibly statist in nature? How much of creativity is developed and how much is innate?',1,1424727240000,11304);
INSERT INTO "Podcasts" VALUES(2963,'54ed8d7a0868cef86b8b6e70','Human Intelligence: The Flynn Effect - A Conversation with Dr. James Flynn ','Dr. James R. Flynn is emeritus professor of political studies at the University of Otago in Dunedin, New Zealand and author, most recently, of What is Intelligence? Beyond the Flynn Effect. Flynn is best known for the Flynn effect, the continued year-on-year rise of IQ scores in all parts of the world. Flynn’s research combines political and moral philosophy with psychology to clarify problems such as justifying humane ideals and whether it makes sense to rank races and classes by merit.',1,1424854140000,4488);
INSERT INTO "Podcasts" VALUES(2964,'54efc3780868cefd6b8b7e90','The Big Picture - Wednesday Call In Show - February 25th, 2015','How can one deal with social anxiety - especially when it comes to dating? Are there negative consequences for adult children being financially dependent on their parents? Doesn’t atheism require the burden of proof to claim that god doesn’t exist? In the recent “There Are No Solutions” video, you said there are no solutions, but is that really true?',1,1424999160000,10669);
INSERT INTO "Podcasts" VALUES(2965,'54f119bb0868ceae358bbe80','The Truth About Spock | RIP Leonard Nimoy ','Leonard Nimoy was an actor, film director, poet, singer and photographer - famous for his role as Mr. Spock in the original Star Trek series and multiple sequels. We examine the cultural impact of the Spock character, what Vulcans represented, how you can “live long and prosper” and if the needs of the many outweigh the needs of the few. 
INSERT INTO "Podcasts" VALUES(2966,'54f3af670868cef76b8b9a39','PAINT IT BLACK - Saturday Call In Show - February 28th, 2015','Is there an objective standard for determining what is Art? The common definition is subjective, using this standard the work of a deranged person smearing feces has the same value as a masterpiece done by a methodically trained, accomplished and dedicated artist. How do I apologize to someone while at the same time conveying the responsibility of others without it coming across as a bullshit non-apology?',1,1425255900000,8745);
INSERT INTO "Podcasts" VALUES(2967,'54f60b760868ce1b038b6f69','Needs and Intimacy: Avoiding Relationship Landmines ','A strikingly important look at the relationship between needs and the possibility for intimacy in relationships.',1,1425410820000,3486);
INSERT INTO "Podcasts" VALUES(2968,'54f89b7e0868ce56638c0b61','What is Art? - Part 1','A multi-part exploration of the question: What is Art? Stefan Molyneux makes the case that Art is often an argument for focusing on something which is easy for society to overlook. How do we put art in context? What can we learn about the artist by viewing their art? How can you explain modern art?',1,1425578700000,2594);
INSERT INTO "Podcasts" VALUES(2969,'54f89bfe0868ce0a2e8b70c7','What is Art? - Part 2','A multi-part exploration of the question: What is Art? Stefan Molyneux makes the case that Art is often an argument for focusing on something which is easy for society to overlook. How do we put art in context? What can we learn about the artist by viewing their art? How can you explain modern art?',1,1425578880000,2148);
INSERT INTO "Podcasts" VALUES(2970,'54fb4caa0868ce8e0c8b4607','The Truth About Sex: Facts You Won''t Believe Are True!','Some shocking trends regarding sexual activity and life outcomes - including the alarming reason why you haven’t already heard this information. There is a mind-blowing correlation in this presentation that you’ve never seen before - and it''s important that you know about it! In the first part of “The Truth About Sex” series, Stefan Molyneux looks at first age of sexual activity, the number of sexual partners, single mothers, abortion, sexually transmitted diseases, stable marriage, child maltreatment, divorce, crime and happiness statistics. What is the truth about sex – and what information do you need to know before playing the big person’s game which makes real people? Upcoming “The Truth About Sex” presentations will include a look at r/k reproductive strategies, polyamory/monogamy, porn, the impact of fatherlessness and much much more! Sources: http://www.fdrurl.com/marriage-sexual-partners-study',1,1425755040000,2606);
INSERT INTO "Podcasts" VALUES(2971,'54fbb0a10868ce8b0c8b4b7f','An Atheist Apologizes to Christians - Call In Show - March 4th, 2015','An incredibly powerful and deeply emotional conversation with a Mormon listener who has lost his faith - and is deeply conflicted about the possibly of leaving his community behind. | I am a very smart person, able to accurately analyze many aspects of life critically, but on the issue of religion, I am more often able to be a 99.999% atheist with the exception of my own emotionally powerful religion. I am confused about what is real and fearful of change while surrounded by spouse, family, friends, and colleagues who will reject me should I reject my religion. How can a philosophical approach help me with this schism in my life? | Socrates said he knew nothing except that he knew nothing. What is your attitude on epistemology and how does it inform your philosophy? Is it the foundation of your worldview - and should it be?',1,1425780720000,11702);
INSERT INTO "Podcasts" VALUES(2972,'54fce1450868ce880c8b5607','Irrational Optimism as Vanity - Call In Show - March 6th, 2015','A repeated pattern in my life has been the pursuit of a certain goal, the attainment of that goal and then disappointment.  Once I have what I want, I find out that it doesn''t make me happy - and am back to square one. What are your thoughts on this kind of pattern - and is this something you''ve experienced yourself? | Having watched "The Truth About Dalai Lama" presentation - do you have objections to the 4-Noble Truths and the 8-Fold Path from Buddhism or strictly the Dalai Lama as an individual? | What are your thoughts on resource based, money-free or gift economies?',1,1425858720000,8795);
INSERT INTO "Podcasts" VALUES(2973,'5502133c0868ce950c8b8512','Saying No to Marriage - Call In Show - March 11th, 2015','The caller wrote: “Most people, including Stefan, advocate committed relationships. However, I feel that voluntarism says that the best relationships are when both parties are allowed to behave and go as they wish to. How do we reconcile the idea of using social pressure and legality to force people to stay together through marriage with the basic principles of voluntarism?
INSERT INTO "Podcasts" VALUES(2974,'5506616b0868ce8b0c8ba948','Wage Fixing and Collusion! Listener Mailbag Questions - Answered!','Stefan Molyneux answers listener questions including: Do you think strict rules designed to change future behavior are a good thing or a bad thing? How can a market properly deal with the issue of wage fixing and illegal collusion among businesses to keep wages down? Is the non-aggression principle like a social contract? Why do children develop impulsiveness? Do you have advice for raising boys? Can there be such a thing as anarcho-socialism? If someone was hoarding the only antidote to an epidemic that was exterminating the human race - would it violate non-aggression principle to seize the antidote?',1,1426480860000,2453);
INSERT INTO "Podcasts" VALUES(2975,'5506646d0868ce950c8ba633','The Truth About School: Another Brick in the Wall!','Almost everybody has “experienced” public school at some point in their life – but what is the truth about school? While the stated goal has always been public education - what is the true origin and development of this institution? In this presentation, Stefan Molyneux described his own experience in public school, early education in Greece, the rise of formal education, the interesting religious backlash, the Prussian school system, modern public schooling, the shocking cost and effects behind this “necessary” institution.” As a student, are you just another brick in the wall? Sources: http://www.fdrurl.com/truth-about-school',1,1426482240000,2906);
INSERT INTO "Podcasts" VALUES(2976,'550884590868ce56118bb9b9','FACT: People Just Don''t Listen - Call In Show - March 14th, 2015','An in-depth discussion of the ‘An Atheist Apologizes to Christians’ show with thoughts and criticisms from a listener - including a callback to John Goodman’s powerful line from the movie Barton Fink: Because You Don’t Listen! Also included: Whose responsibility is it – the employers, employees or the recruiters - to find out whether or not the candidate is a good personality match for the team?  How important is this personality factor in having a successful business?',1,1426621020000,10615);
INSERT INTO "Podcasts" VALUES(2977,'550aff370868ce860c8bc903','Dungeons and Dragons - Oh Yes!','After several requests, Stefan Molyneux describes his experience playing Dungeons and Dragons.',1,1426783980000,1344);
INSERT INTO "Podcasts" VALUES(2978,'550cf16d0868ce81168bd357','The Isolated Male - Call In Show - March 18th, 2015','Ayn Rand''s novel ‘Anthem,’ the difficulty of achieving excellence, putting people in personality type cages, to categorization is dehumanization, the chains of unchosen familial roles, pushing circumcision on new parents, children as proxy wars, preserving sibling relationships, trying to escape emotions through immediate action, society as a self-correcting system, the evolution of individualism, having the back of the people you care about and female driven male isolation.',1,1426911420000,10426);
INSERT INTO "Podcasts" VALUES(2979,'550f24370868ce8b0c8be783','Take The Red Pill - Call In Show - March 21st, 2015','A rant-tacular show! Questions discussed include: Referencing the Matrix - do you believe that some people are just not ready for the red pill? I’ve given my two weeks’ notice at my job of fifteen years and am starting to panic - why do I feel so scared? Is the cultural focus on ‘beauty’ abusive towards women? I’m a public school teacher - how can I assist children who are being bullied and best help my students?',1,1427055480000,10309);
INSERT INTO "Podcasts" VALUES(2980,'551443d10868ce41428ba6db','Mandatory Vaccinations ','Lately there has been a huge discussion about vaccines in the United States. This isn’t a question about whether vaccines are safe or not - but as a philosopher, what are your thoughts on the mandatory requirements for anything - whether they be vaccinations, wearing of purple hats or college application fees?',1,1427391300000,1434);
INSERT INTO "Podcasts" VALUES(2981,'5514447c0868ce910c8c09ce','How to Overcome an Inferiority Complex - Call in Show - March 25th, 2015','I have a wonderful fiancée, but have recently come down with a crippling inferiority complex in light of her recent career success. I want to be supportive, but it’s tearing me to pieces inside and it makes me feel useless as a man. How can I simply accept the circumstances and see us as a team? How would a free society defend against an invading statist army? Do you think it will be beneficial for atheists to impersonate the best qualities of religion? Should atheists organize into churches, create holiday - and create their own traditions for marriage, funerals, and coming of age ceremonies?',1,1427391480000,7832);
INSERT INTO "Podcasts" VALUES(2982,'5516c65b0868ce7b0e8c18fb','Mandatory Voting. Thanks Obama! ','President Barack Obama has created a political firestorm by floating the idea of mandatory or compulsory voting. "If everybody voted, then it would completely change the political map in this country," Obama said, calling it "potentially transformative." Not only that, Obama said, but universal voting would "counteract money more than anything." Stefan Molyneux has some thoughts on the subject, mandatory voting?  Thanks Obama!',1,1427555820000,697);
INSERT INTO "Podcasts" VALUES(2983,'551863080868ce8b0c8c2516','Andreas Lubitz Germanwings Flight 9525 Crash | Propaganda Decoded','On Tuesday, Germanwings Flight 9525 crashed into the French Alps, killing all 150 people on board. The 27-year-old German co-pilot, Andreas Lubitz - locked the captain out of the cockpit, ignored desperate pleas to open the cockpit door and deliberately glided the plane straight into the mountains.
INSERT INTO "Podcasts" VALUES(2984,'5519b6d90868ce860c8c2ae6','The Estrogen Decoder Ring - Call In Show - March 28th, 2015','Do you think the rejection of altruism by Ayn Rand’s objectivist ethics is oppressive given the scientific research showing altruistic behavior in many primates? I recently came out of a six month relationship and have a very hard time trusting women due to my past experiences -  how do I know if certain warning signs are legitimate or if I’m simply being insecure? Includes: finger biting bonobos, how welfare destroys any sense of community, government as a replacement for love which wasn’t earned, craziness as sexual lubricant, the gloryhole of superstition, relationship warning signs, dodging bullets and a conversation everyone in the dating pool needs to hear.',1,1427748360000,10838);
INSERT INTO "Podcasts" VALUES(2985,'551a1bd00868ce7b0e8c3044','Why Advertising Corrupts','Freedomain Radio is 100% funded by viewers like you. Please support the show by signing up for a monthly subscription or making a one time donation at: http://www.freedomainradio.com/donate',1,1427774280000,605);
INSERT INTO "Podcasts" VALUES(2986,'551d8a520868ce41428be666','The Chains of Racial Identity - Call In Show - April 1st, 2015','As a mixed-race, American man, and I am deeply concerned about the increasing racial tension in America. Worse, I know that I am - at least, incrementally - part of the problem. I have experienced both white privilege and black disadvantage, white pride and black shame. In certain circumstances, I have even felt black privilege and white disadvantage, black pride and white shame. I believe that racial identity is a fiction to some degree; However, from a practical standpoint, I do not believe that human beings can completely overcome the instinct to stereotype others based on their physical features. How can I both humbly and proudly carry all the pieces of my real identity, racial pieces included? | Given the libertarian understanding of fiat currency and the banking system - what is the ethical approach to debt – such as long term mortgages?',1,1427999160000,7462);
INSERT INTO "Podcasts" VALUES(2987,'551deccb0868ce147e8be931','California''s Water Crisis | True News','An in-depth look at the real cause of the California water crisis and the history which lead to this challenging situation. Why are farmers trying to grow water intensive crops in a desert environment? How could farming in a desert possibly be cost effective? What role do taxpayer funded Dam projects and government subsidies play in this shortage?  Stefan Molyneux, host of Freedomain Radio, breaks down at the hidden story behind this growing problem.',1,1428024420000,881);
INSERT INTO "Podcasts" VALUES(2988,'5521a1a90868ce56118c6602','Neurotic Human Vending Machines - Call In Show - April 4th, 2015','It has been said that the reason for the low birthrates in Europe is the high level of taxes - how does Stefan explain nations such as Hong Kong, Korea, Japan, Taiwan and Singapore which have lower taxes and lower birthrates? | As a parent - do you think it’s important to make an effort to ‘socialize’ your children? | What are your thoughts on the morality and implementation of the “Unconditional Basic Income” welfare system both now and in the future?',1,1428267300000,5232);
INSERT INTO "Podcasts" VALUES(2989,'552589970868ce950c8c7cb8','Anti-Marriage Prejudice | YouTube Comments - Rebutted!','Stefan Molyneux dives into the hive mind of YouTube comments and responds to feedback. Do the laws of physics break down at the edge of the universe? Has Stefan joined the anti-platypus lobby? Does the world revolve around the opinions and power of white men? How much does Stefan really know about philosophy? Why doesn’t Stefan talk about analytic and continental philosophy?',1,1428523200000,3282);
INSERT INTO "Podcasts" VALUES(2990,'552600c20868ce8b0c8c867f','Pizza War: Gay Discrimination vs. Religious Freedom | True News ','Memories Pizza in Indiana is under heavy criticism after saying that they wouldn’t cater a gay wedding because it was against their Christian religious beliefs. Indiana’s Republican Gov. Mike Pence signed the “Religious Freedom Restoration Act” last week with the goal of giving business owners a stronger legal defense if they refuse to serve lesbian, gay, bisexual and transgender customers on religious grounds. Should businesses be forced to serve all potential customers? Should people be allowed to discriminate based on their religious beliefs? Stefan Molyneux, host of Freedomain Radio, takes a look at the Indiana Pizzeria controversy and the discrimination debate.',1,1428553800000,852);
INSERT INTO "Podcasts" VALUES(2991,'552775ce0868ceae368c9132','The High Cost of Fame - Call In Show - April 8th, 2015','I''m a gay restaurant server and I''d like to talk about the Religious Freedom Restoration Act - do you think there should be a law to prevent discrimination? | I''m working on a project that explores the motivations behind "stage parents," the potential negative psychological effects on their children involved, and the importance of raising your child to be an independent individual. What do you think it would take for these parents to realize the damage they''re doing to their children, if they are in fact forcing their unfulfilled dreams upon them? | Am I coming across as rational with my arguments against statism on social media?',1,1428649260000,10479);
INSERT INTO "Podcasts" VALUES(2992,'55284c1c0868ce7b0e8c932d','Winners and Losers ','Why are people so afraid of freedom?  Why do most individuals run to governments - eager to make an unholy bargain - sacrificing their freedoms for the illusion of protection and security?',1,1428704160000,1651);
INSERT INTO "Podcasts" VALUES(2993,'552b14cf0868ce147e8c42c2','Criticism: The Truth About Sex - Call In Show - April 11th, 2015','If you like rant-filled shows, then this is the show for you! | Given what we perceive to be a respectable track record for choosing compelling source material for "The Truth About" series video posts, this latest edition on "Sex" seems to have missed the mark for us after a casual listen and became grossly misleading after a more invested listen. Since when does a report generated by a DC based conservative think tank, with a mission to formulate and promote conservative public policies in the United States, constitute a valid body of knowledge to anchor such a definitive video title and 45 minute pontification on a topic as wildly divergent from culture to culture around the world and often even more diverse within the same local geography in modern urban environments? | What are your thoughts on the research out of social psychology on persuasion, influence, compliance, and its application to marketing and sales? These customers aren''t being FORCED into buying anything, but their decisions can become convoluted using information about their own neurological functions; functions they may not even be aware of. Is this moral? Is this ethical? Do you think this behavior would be encouraged, or discouraged, in a free market? | Do you recommend any particular methodology for cultivating, nurturing protecting and sustaining relationships?  Are people committed to self-knowledge and self-respect left to high turnover in relationships?',1,1428886560000,11825);
INSERT INTO "Podcasts" VALUES(2994,'552c2d0c0868ce60288b60f2','Rapegate | The Truth About Rape','Rolling Stone''s “A Rape on Campus" story about the University of Virginia chapter of Phi Alpha Psi. Columbia University’s Mattress Girl Emma Sulkowicz. Lena Dunham on "Barry" in “Not That Kind of Girl.” The Duke Lacross case. Tawana Brawley. The NFL''s Ray McDonald. What do all these cases have in common? It''s time for a frank conversation about rape, false rape accusations, the damage this does to the true victims of rape - and how we can stop it!',1,1428958320000,844);
INSERT INTO "Podcasts" VALUES(2995,'552d4a6e0868ce02208c47db','Walter Scott Shooting, Officer Michael Slager Charged | True News ','Officer Michael Slager pulled over Walter Scott in a routine South Carolina traffic stop - and the events which followed left Walter Scott dead and Officer Slager charged with murder and stripped of his badge. An incredibly shocking video was recorded by a witness, showing a struggle between the two men - ultimately ending with Officer Slager firing eight shots into Walter Scott''s back. What has been the reaction to this situation? What facts do we know?  Is this another Trayvon Martin or Michael Brown situation? Stefan Molyneux looks at the facts as they are known and shares an important message about this terrible situation.',1,1429031400000,852);
INSERT INTO "Podcasts" VALUES(2996,'552ec2240868ce011c8bce91','The Hidden Truth Behind California''s Water Rationing | True News ','In the middle of a massive drought, California braces for its first mandatory water reductions on urban consumption, which accounts for approximately ten percent of the state’s usage - but is that the REAL problem? Stefan Molyneux looks at the plethora of hidden causes of the California Water Crisis.',1,1429127580000,682);
INSERT INTO "Podcasts" VALUES(2997,'553136020868ce24368b477f','Consciousness, Free Will, Morality and Superstition ','Will further knowledge of the brain reveal consciousness and free will and morality to be superstitions? Will greater medical and scientific advancement reveal determinism to be true and the existence of free will and morality to be completely irrational?',1,1429288380000,2347);
INSERT INTO "Podcasts" VALUES(2998,'55352b300868ce41368b6317','D!#knapping - Call In Show - April 18th, 2015','Question 1: I’ve been involved in a love-triangle with myself and another man seeking the same woman. I no longer want to be involved in this kind of behavior, how do I hold myself to a higher standard of behavior in my romantic relationships? | Question 2: What is the right reason to become a parent? What would be the minimum requirements as far as personal qualities go to be able to responsibly make this choice? | Question 3: Is the donation model the best way to fund Freedomain Radio? Closing Conversation: The Walter Scott/Michael Slager shooting and important things to keep in mind.',1,1429547580000,9840);
INSERT INTO "Podcasts" VALUES(2999,'55366a560868ce0c368b6e2f','Liberals and Conservatives Will Never Agree - A Conversation with William Gairdner ','Stefan Molyneux and William Gairdner discuss the massive divide between liberals and conservatives - and why the two groups will never, ever agree.
INSERT INTO "Podcasts" VALUES(3000,'5537b1fa0868ce0b368b78bc','The Truth About Makeup','Makeup has been around for many centuries. When you look at the scientific evidence, it’s no wonder that over $40 billion dollars is spent on cosmetics each year. We are drawn to makeup because that it taps into our primal urge to find a young, healthy mate who will produce lots of kids so that we can pass on our genes. What is - The Truth About Makeup? | Freedomain Radio is 100% funded by viewers like you. Please support the show by signing up for a monthly subscription or making a one time donation at: http://www.fdrurl.com/donate',1,1429713240000,855);
INSERT INTO "Podcasts" VALUES(3001,'5539ab3e0868cefd1d8b48bf','Statists Gonna State - Call In Show - April 22nd, 2015','Question 1: What is the secret to staying well-informed about what’s going on in the world - but also maintaining your sanity and avoiding depression? | Question 2: After bringing philosophy into my romantic life, my friendships, and my family relationships, I am struggling to bring philosophy into the career side of my life. What are the benefits of bringing philosophy in the space of making money? | Question 3: Where do Christianity and philosophy intersect? What goals and principles do we have in common and how might we relate to each other in a way that is mutually beneficial? | Question 4: I''m in my final year of college, studying for a Bachelor''s in screenwriting, but I''ve completely lost my motivation and drive - how can I stop procrastinating and get the work done?',1,1429842600000,9868);
INSERT INTO "Podcasts" VALUES(3002,'553d3fe10868ce0b368b9e66','Eat. Sleep. Bad Decision. Repeat. | Breaking the Cycle - Call In Show - April 15th, 2015','Question 1: How you address the stereotyping and hyper-sexualization of female characters in popular culture - in particular kids'' video games - with your daughter? Also includes an in depth discussion of out of wedlock child birth, bad relationship choices, divorce, child custody disputes and how to break repetitive cycles of dysfunction. |Question 2: Do you think that you can “pay it forward” to the next generation and make the world a better place without having children?',1,1430076720000,7945);
INSERT INTO "Podcasts" VALUES(3003,'553d44450868ce24368b9d50','CRAYDAR | Crazy Detecting Radar System - Call In Show - April 25th, 2015','Question 1: What are the ethical and moral limitations of editing the human genome? Includes an impromptu minarchism vs. anarchism discussion. | Question 2: Universally Preferable Behaviour (UPB) Debate! | Question 3: What’s the best way of dealing with people who are being annoying?  | Question 4: What are some good ways to spot a sociopath? Includes a lengthy back and forth conversation about warning signs and red flags to keep in mind.  If you can think of more, please do email them to operations@freedomainradio.com and we’ll put together a massive list!',1,1430078340000,11887);
INSERT INTO "Podcasts" VALUES(3004,'553fb9000868ce1c368baab7','The Truth About Single Moms ','Single Mothers are talked about in glowing terms for their hard-work, determination and fortitude - but what is the truth about single moms? | Motherhood has evolved quite a bit over the last fifty years: more women are having their children later in life - or in less traditional ways: before and outside marriage. Single motherhood has become so incredibly common that it is projected that soon - half of all children will live with a single mom at some point before the age of eighteen. | What kind of impact does single motherhood have on society?  What impact does single motherhood have on children? Are Fathers important - and what impact does growing up in a fatherless home have? What is the Truth About Single Moms? | Sources: http://www.fdrurl.com/truth-about-single-moms | Transcript: http://www.fdrurl.com/single-moms-transcript',1,1430239260000,4455);
INSERT INTO "Podcasts" VALUES(3005,'554013490868ce2e368bb131','Black Lives Matter #BaltimoreRiots | True News','In the aftermath of Freddie Gray’s death in the hands of Baltimore Police - sections of Baltimore convulsed in riots, arson and looting. Stefan Molyneux looks at history, past decisions and their hidden impact - which have lead to serious frustrations within the black community.',1,1430262480000,2151);
INSERT INTO "Podcasts" VALUES(3006,'5542888f0868ce23368bbe18','You''re Making Me Guilty Damn You! | YouTube Comments - Rebutted!','Stefan Molyneux dips into the YouTube comments to discuss discrimination, passive aggression, the use of universal principles in Philosophy, socialist economics, supply and demand, money corrupting government climate science, scare-mongering for the purpose of gaining political power and making somebody feel guilt.',1,1430423580000,2594);
INSERT INTO "Podcasts" VALUES(3007,'554423710868ce6c1c8b6ee7','Coming Out of the Closet - Call In Show - April 29th, 2015','Question 1: I am a twenty-three year old, homosexual black American male, living in a religious family household. Do you have any advice or suggestions as how to be honest with my family about my sexuality? | Question 2: I’m currently an entrepreneur, but have the chance to take over the established family business.  I don’t think I can do both, and am conflicted about my choice – can family and business mix? | Question 3: What do you think of making it normal and completely above the table, for husbands to visit young prostitutes once their wife’s aging starts to show? | Question 4: Ever since I was young, I have had an irrational fear that everyone else is cocky, mean, and won’t like me - why am I terrified of people before I get to know them?',1,1430528700000,14536);
INSERT INTO "Podcasts" VALUES(3008,'55444f4c0868ce37368bca82','The Truth About Freddie Gray','On April 19, 2015, Freddie Gray, died as a result of injuries sustained while in the custody of the Baltimore Police Department. He was 25 years old. But the tragedies within this story began much much earlier - and continue, even after his early death. As Baltimore burned in the background and protestors rioted - criminal charges were filed against the six police officers who were believed to be involved in his death. Will the justice be served in a court of law - or are there more complicated elements involved in this tragic story which need to be addressed? What is the Truth About Freddie Gray?',1,1430539980000,1367);
INSERT INTO "Podcasts" VALUES(3009,'55478be40868ce2f368bdaaa','How Adolf Hitler Destroyed Germany | George Reisman and Stefan Molyneux','Stefan Molyneux discusses "Why Nazism Was Socialism and Why Socialism Is Totalitarian" with George Reisman and the economic destruction of Adolf Hitler''s totalitarian controlled Germany. | George Reisman is the author of Capitalism: A Treatise on Economics; and is the Professor Emeritus of Economics at Pepperdine University. For more from George Reisman, go to: http://www.capitalism.net | http://georgereismansblog.blogspot.com | https://twitter.com/GGReisman',1,1430752080000,2744);
INSERT INTO "Podcasts" VALUES(3010,'55478c7c0868ce2b368bdee9','Why Nazism Was Socialism and Why Socialism Is Totalitarian','Why Nazism Was Socialism and Why Socialism Is Totalitarian by George Reisman - read by Stefan Molyneux, host of Freedomain Radio. | George Reisman is the author of Capitalism: A Treatise on Economics; and is the Professor Emeritus of Economics at Pepperdine University. For more from George Reisman, go to: http://www.capitalism.net | http://georgereismansblog.blogspot.com | https://twitter.com/GGReisman',1,1430752260000,1941);
INSERT INTO "Podcasts" VALUES(3011,'554925130868ce9b508b4867','Opps. SPLAT! Dead. - Call In Show - May 2nd, 2015','Question 1: Stefan presents varying evidence and statistics to make the claim that it is "best" for men to get married. Why does Stefan present overwhelming evidence of the benefits of marriage but discounts the risks to reach such a broad conclusion? |Question 2: What is masculinity? | Question 3: Freedomain Radio changed my mind about wanting to have children and being a stay-at-home mother – how do I find a great man to be my husband? What do great quality men look for in a woman?',1,1430856840000,12033);
INSERT INTO "Podcasts" VALUES(3012,'5549258a0868ce25368beb19','How To Fight Police Brutality!','It is very tempting to spend one’s anger and outrage on particular manifestations of an unjust system – but all that does is pretend that the rest of the system is somehow just. In magic, this is called “misdirection,” which is the art of drawing the attention of the audience away from the hand actually performing the trick. In the black magic of politics, this is called “the media.” When you cover the air horn blaring of the media circus, the true constellations of political power become immediately visible. Listen on and discover how we truly end police brutality! | Text and Sources: https://board.freedomainradio.com/topic/44069-articlevideopodcast-how-to-fight-police-brutality/',1,1430857020000,1025);
INSERT INTO "Podcasts" VALUES(3013,'554bfbe20868ce2d368bfd6c','Police Ambivalence - Call In Show - May 6th, 2015','Question 1: I live in Baltimore and have experienced the rioting first hand.  I question the Constitutionality of the curfew, but I am at the same time overjoyed at the curfew.  I live in a beautiful but noisy section of town - normally lots of fights outside in the middle of the night.  I’m surprised at how quickly I stepped off my principles to wallow in the short-term gratification of peace and quiet - and a decrease in the likelihood that there would be more property damage. Can you help me understand my ambivalence? | Question 2: How do I deal with the feeling of hopelessness and inferiority that I get from not being able to (directly) positively impact my own outcomes in spite of the fact that I have been able to help many others achieve what I desire? I want to be a good father for my son, and I don’t want him to grow up with this lack of agency as a role model. | Question 3: Many years ago there was a scene in an episode of Futurama where the human race goes extinct because they all chose sex robots that look exactly like celebrities, such as Marilyn Monroe, instead of dating each other and having children. While far-fetched years ago, it seems probable than within less than a decade there might be a thriving sex robot industry. So in the long run, how is marriage and human-to-human sexual relationships going to compete with sex robots?',1,1431042780000,10344);
INSERT INTO "Podcasts" VALUES(3014,'5550938e0868ce2c368c17df','The Burden of Proof | Empathy Edition','Stefan Molyneux looks at the dismissive reaction of many atheists to “The Atheist''s Burden of Proof” video and why it’s important to help people understand - what they simply don’t understand.',1,1431343860000,1326);
INSERT INTO "Podcasts" VALUES(3015,'555094100868ce31558c170a','Horror, History and Heroin | Dr. Gabor Maté and Stefan Molyneux','Stefan Molyneux speaks with Dr. Gabor Maté about a wide range of topics including addiction, stress, empathy and childhood development. Dr. Maté has written several bestselling books including the award-winning In the Realm of Hungry Ghosts: Close Encounters with Addiction; When the Body Says No: The Cost of Hidden Stress; and many more. For more information, go to: http://drgabormate.com/',1,1431344040000,2910);
INSERT INTO "Podcasts" VALUES(3016,'555216f80868ce2d368c24f5','The Hobbit: The Battle of the Five Armies | True Stories ','Is there a hidden story behind The Hobbit Trilogy and Lord of the Rings? Warning: Spoilers! In The Hobbit: The Battle of the Five Armies - having reclaimed Erebor and vast treasure from the dragon Smaug, Thorin Oakenshield (Richard Armitage) sacrifices friendship and honor in seeking the Arkenstone, despite Smaug''s fiery wrath and desperate attempts by the Hobbit Bilbo (Martin Freeman) to make him see reason. Meanwhile, Sauron sends legions of Orcs in a sneak attack upon the Lonely Mountain. As the fate of Middle Earth hangs in the balance, the races of Men, Elves and Dwarves must decide whether to unite and prevail - or all die.',1,1431443100000,605);
INSERT INTO "Podcasts" VALUES(3017,'5555182a0868ce6c1c8bdfe0','Socialism as Pornography - Call In Show - May 9th, 2015','Question 1: My wife wants to divorce me. Is it possible to save our marriage and if not - what should I do to minimize the damage to our son? | Question 2: Is it possible to morally serve in the military, and what should a person do if they have already enlisted? | Question 3: Are we going to see a Bolshevik like attempt in North America, where the race and class resentful left, unable to win the argument using evidence, use violence to get their way?',1,1431639240000,10651);
INSERT INTO "Podcasts" VALUES(3018,'55553faa0868ce2f368c3a24','How to ‘Find Yourself’ - Call In Show - May 13th, 2015','Question 1: My band is working with others musicians and interacting with a manager and label.  What level of intimacy and connection should I have as a standard in order to achieve success? What is your experience of working with others in business?  What made your business relationships successful?  Do you have any advice and tips on working with others in business? | Question 2: What does it mean to "find yourself" and why is it so often associated with being attainable through travel and ‘getting lost?’ | Question 3: I’m a single father of a young daughter and am interested in dating again. While I know how to date I have no idea how to appropriately filter my daughter’s insight into my dating life - do you have any suggestions? I’m also concerned about the type of woman that would be interested in dating a single father. Does a single father have any chance of finding a ‘good woman’ when the single mothers in my extended social web seem to only find jerks?',1,1431649800000,9119);
INSERT INTO "Podcasts" VALUES(3019,'55561c7c0868ce2a6e8b74a7','The Truth About David Letterman','David Letterman has been involved in the entertainment industry for over forty years and tends to be a very divisive figure. Some people loved the affable everyman who caustically poked holes in the facade of celebrity, while others found Letterman to be mean-spirited and aggressive. What isn’t up for debate is the sizable role he’s played within American culture over the course of multiple decades. Whether you’re a fan or not, everybody knows the name David Letterman and his sarcastic wit has left an imprint on generations of observers. A deeply private man, Letterman’s relationship with his own celebrity and success is as complicated as it is fascinating. At many points in his career it seemed the only thing Letterman feared more than outright failure were the consequences and pressure of his own achievements. For a man who often took the wind out of pompous, egotistical celebrities – who dared to take themselves too seriously – Letterman was a workaholic, nearly obsessed with achieving perfection in his performances, and left a trail of broken relationships in his wake. Subjective opinions abound, but what is The Truth About David Letterman? | Sources: http://www.fdrurl.com/david-letterman',1,1431706440000,8903);
INSERT INTO "Podcasts" VALUES(3020,'555a31680868ce6c1c8bff91','Judgment as Violence - Call In Show - May 16th, 2015','Question 1: Is Non-Violent Communication Universally Preferable Behavior? | Question 2: I am feeling stuck. It’s been about two years since my significant other left. We have two children, one who is an adult and on her own and one who lives with me. After finding you, I began to peaceful parent for the last year and a half. The problem I am having is determining what to do when my needs and my child’s needs are in conflict. I am trying to heal myself and prevent as much damage as I can to my child. How do I determine when the benefit of my long term well-being overrides her short term needs for her long term benefits?',1,1431974100000,5153);
INSERT INTO "Podcasts" VALUES(3021,'555b56a90868ce37368c647f','The Truth About George Washington','George Washington was unanimously elected as the first president of the United States of America after winning the American Revolutionary War as the Commander-in-Chief of the Continental Army.
INSERT INTO "Podcasts" VALUES(3022,'555e44f00868ce9a508bd6b1','Subjective is Objective? - Call In Show - May 20th, 2015','Question 1: Is the subjective theory of value a valid claim? | Question 2: If your significant other begins to fail to meet your rational standards in a relationship, is it worth it to try to change them back? What is the best way to go about doing this and what level of responsibility do we have in imposing rational standards on the ones we care deeply about? Or - is this all too demanding/controlling?',1,1432241160000,9210);
INSERT INTO "Podcasts" VALUES(3023,'555f6d450868ce9d2a8bfbad','What The Media Won''t Tell You!','How is it possible to be positive and enthusiastic given all of the bad news around the world? Stefan Molyneux looks at some of the incredibly positive news and trends which show ways the world is getting better. Includes a look at: violent crime, assault, property crime, gun crime, violence against children, life expectancy, infant mortality and much much more!',1,1432317120000,1175);
INSERT INTO "Podcasts" VALUES(3024,'556258d20868ce41368c9262','Unobtanium, One World Government and The Moon - Call In Show - May 23rd, 2015','Introduction: The Problem with Nature Documentaries | Question 1: In committed relationships, physical cheating is obviously a no-go, but other things like ''flirting with the opposite sex'' can exist in a grey area. How can one rationally delineate boundaries in romantic relationships? | Question 2: Raising children with violence actually releases chemicals causing apoptotic cell death in the active areas of the brain during violent incidents, similar to forming a logic gate in a silicon structure of a computer. Isn’t this smoking gun evidence proving that one should follow the non-aggression principle? | Question 3: I am having trouble finding a definition of property that would explain ownership of finite things that are not products of a person''s labor. The definition that I have heard provided by Stefan is "property is something that is created," and I agree with this statement, but I am not sure that it explains how something that was not produced by a person can be exclusively used by that person.',1,1432508400000,8331);
INSERT INTO "Podcasts" VALUES(3025,'55648a970868cef40d8b52cf','What You Didn''t Know About IQ | Dr. Kevin M. Beaver and Stefan Molyneux','Criminology expert Dr. Kevin M. Beaver and Stefan Molyneux discuss the impact of parenting on child intelligence, the predictable capabilities of IQ, the evolutionary behavioral genetics of violent crime and possible explanations for the massive drop in criminality. Dr. Kevin M. Beaver is an expert on biosocial criminology, which explores the biological and environmental factors involved in crime and antisocial behavior.',1,1432652160000,2292);
INSERT INTO "Podcasts" VALUES(3026,'556549f20868ce7e708b5789','Unchosen Positive Obligations: The Self-Sacrifice of Subsidy','Why are people so hostile to the idea of a free society? Are people really angry about how roads will be hypothetically built centuries from now? Stefan Molyneux discusses the reality of unchosen positive obligations, the self-sacrifice of subsidy and the origin of hostility to voluntary interactions.',1,1432701240000,1674);
INSERT INTO "Podcasts" VALUES(3027,'5566c2cd0868cef70d8b62e9','The Truth About Male Privilege ','Male Privilege is a term for social, economic, and political advantages or rights that are made available to men solely on the basis of their sex. Feminists tend to believe that they are living under patriarchy - where men hold the power and women are unfairly exploited. Stefan Molyneux looks at the statistics and data in an attempt to answer the question - what is The Truth About Male Privilege? | Sources: http://www.fdrurl.com/male-privilege',1,1432797300000,5246);
INSERT INTO "Podcasts" VALUES(3028,'55683e5b0868ce7e708b69ea','The Biology of White Knighting - Call In Show - May 27th, 2015','Question 1: I am having difficulty understanding how we can remove the concept of the State from a society which practices the concept of property ownership. Aren''t States, at least in the traditional sense of monarchs and limited republics, nothing more than one or a group of human property owners collectivizing their efforts to defend property from natural forces? | Question 2: My wife is the definition of a keeper, but I’ve completely friend-zoned her. Is just a friendship good enough for a long-lasting romantic relationship? Is such a relationship a good ground for raising healthy children? Or is there a way to reignite the feeling? | Question 3: My daughter recently turned four. I know that someday soon I will need to address the concept of government and all of the joys that come along with it: coercion and war. How do I introduce the state to my young daughter, without glorifying it or traumatizing her?',1,1432894800000,9453);
INSERT INTO "Podcasts" VALUES(3029,'556849850868cef30d8b6d17','Government Mandated Circumcision! | True News','After 1½ years of fighting against the mutilation, Heather Hironimus was jailed after she fled to protect Chase Nebus-Hironimus from a court order demanding that he be circumcised.  Jailed since May 14th for defying a judge''s custody order and refusing to let her son be circumcised - Hironimus gave her consent - under duress - to the procedure wanted by the boy''s dad, Dennis Nebus. Heather Hironimus is now charged with interference of custody, a third-degree felony, from her months of hiding with the boy in a local domestic violence shelter. | Stefan Molyneux speaks with Georganne Chapin from Intact America about the trends in circumcision, the myth of its medical necessity, the tragic Heather Hironimus case and what can be done to end this barbaric practice in the world today. | Georganne Chapin is the executive director of Intact America and the Secretary of Attorneys for the Rights of the Child. For more go to: http://www.intactamerica.org and https://www.facebook.com/intactamerica',1,1432897860000,2133);
INSERT INTO "Podcasts" VALUES(3030,'556b7c7f8ead0ec50b8b5137','An Introduction to Capitalism','An entertaining introductory look at capitalism, property rights, the redistribution of “wealth” and inequality within society. Private ownership of the means of production is the consistent application of property rights within society.',1,1433105640000,1945);
INSERT INTO "Podcasts" VALUES(3031,'556c1a3f8ead0ec1098b5557','Passive-Aggressive Communication - Call In Show - May 30th, 2015','Question 1: How can you demonstrate the power of psychology to someone who views it as nothing more than superstition - like believing in a deity? Isn''t it true that to ‘outsiders,’ therapy and learning to trust your emotions is not that different from what religious people call faith? | Question 2: During the May 16th show, Judgment as Violence, you proposed several criticisms of the late Marshall Rosenberg''s guidelines for achieving what he labeled, Nonviolent Communication, that I found to be quite troubling. I believe there are several logical errors in your explanation that concern me, but ignoring them, I have two main questions.  Why is it that all communication must be seen as nonviolent?  How can verbal abuse be nonviolent? |Question 3: Is it moral to have children when you''re either physically and/or mentally ill?',1,1433147820000,13805);
INSERT INTO "Podcasts" VALUES(3032,'556ed0278ead0e1d6a8b499f','Bill and Hillary Clinton: Merchants of Power | True News ','Amidst the media storm surrounding Hillary Clinton''s presidential bid, Stefan Molyneux identifies the larger patterns within the Clinton Cash/Clinton Foundation controversy. Are the Clintons corrupt? What does their questionable behavior say about politics as a whole? Learn about the practice of selling power in this latest installment of True News.',1,1433325540000,1290);
INSERT INTO "Podcasts" VALUES(3033,'556fb99b8ead0e0b6a8b518f','The TSA''s 95 Percent Failure Rate | True News','Recently, the Department of Homeland Security decided to test the effectiveness of the Transportation Security Administration (TSA) by conducting a series of undercover tests. The results were quite shocking. Investigators were able to smuggle mock explosive and banned weapons in 67 out of 70 attempts. That''s a failure rate of 95 percent!',1,1433385240000,426);
INSERT INTO "Podcasts" VALUES(3034,'556fba1f8ead0e216a8b5067','The USA Freedom Act | True News','On June 2, 2015, Obama signed into law the USA Freedom Act, which as an acronym for Uniting and Strengthening America by Fulfilling Rights and Ending Eavesdropping, Dragnet-collection and Online Monitoring Act. What a delightful name! The USA Freedom Act!',1,1433385360000,431);
INSERT INTO "Podcasts" VALUES(3035,'557058848ead0e9e278b6977','Does Men’s Rights Ruin Relationships? - Call In Show - June 3rd, 2015','Question 1: I had a messy break-up with my girlfriend of 3 years - for both of us this was our first love. I fear that perhaps my research into Men''s Rights has caused me to be hyper critical of her - can Men''s Rights ruin loving relationships? | Question 2: My life feels like a ping-pong game between impatience and boredom. Whenever I have something to do, like working or visiting family, I get impatient and find myself yearning for alone time. Whenever I have some alone time, I find myself bored, unmotivated and yearning for something to do. How can I break this cycle of dissatisfaction and enjoy each of life''s situations for what they are worth? | Question 3: What is our responsibility to our elders as adults?',1,1433425680000,14608);
INSERT INTO "Podcasts" VALUES(3036,'5572f72e8ead0efd0d8b81d1','The Myth of Small Government ','If there was a government which provided a standing military (only for defense) and a basic court of law - would you support such a government? Stefan Molyneux examines the myth of small government.',1,1433597640000,1466);
INSERT INTO "Podcasts" VALUES(3037,'557452e68ead0ed2118b8667','Incomprehensible Bravery - Call In Show - June 6th, 2015','Question 1: How do you know when you''re “done” with therapy? I escaped a fundamentalist religious cult and have a hard time being passionate about the next stage of my life - do you have any suggestions? | Question 2: A listener reads a letter detailing how his older son found the show and convinced his younger son from pursuing his military career. | Question 3: I''m currently a resident physician in Emergency Medicine. This profession requires deductive reasoning, a rational approach to problems, and critical thinking to successfully treat patients. However, it has become increasingly clear that a great number of people who share my profession do not seem to follow these aspects of thinking when it comes to other issues. Why do you think this occurs in people who have devoted their life to something that requires one to be logical and rational?',1,1433686560000,11358);
INSERT INTO "Podcasts" VALUES(3038,'5575b3d18ead0e136a8b737f','WAR | What They Won''t Tell You! ','It has been often said that war is the health of the state - but the argument could also be made that the reverse is more true: that the state is the health of war. In other words, that war - the greatest of all human evils - is impossible without the state. Article: http://www.fdrurl.com/warhealth',1,1433776980000,1342);
INSERT INTO "Podcasts" VALUES(3039,'55774e128ead0e6a168b95bf','Impacting Intelligence (IQ) | Stefan Molyneux and Hank Pellissier ','Stefan Molyneux and Hank Pellissier discuss Intelligence including ways in which human intelligence can be decreased by chosen behavior. Why is the IQ of Ashkenazi Jews so high compared to the general population? What religious tradition has had a fascinating dysgenic impact on intelligence? Should college education be free? Hank Pellissier is a humanitarian writer, editor, speaker and producer, especially on futurist and transhumanist topics. He’s the author of several books including "Brighter Brains: 225 Ways to Elevate or Injure IQ" and "Why is the IQ of Ashkenazi Jews so High?"',1,1433881980000,3024);
INSERT INTO "Podcasts" VALUES(3040,'5578dd268ead0e216a8b8920','A Brief History of Tomorrow','How did we get to where are today? How did we get to economic stagnation, the slow strangulation of liberties? How did we get to where we will be tomorrow, with economic collapse and the war of words of all against all? Here is a very rapid tour through the destruction of rationality.',1,1433983920000,952);
INSERT INTO "Podcasts" VALUES(3041,'5579b9638ead0e176a8b8e2f','The Horror of Depression - Call In Show - June 10th, 2015','Question 1: In a world overrun by a lack of self-knowledge who holds responsibility in ensuring people at high risk of mental illness seek treatment before they raise children? | Question 2: I think my self-doubt comes from the conclusion I reached recently that my parents are not intelligent. I believe that intelligence is genetic since I am a product of my parents I see myself as unintelligent also. If my success depends on my genetics, something which I have no control over then I believe somehow, that I am destined to lead an unhappy life. What are the origins of self-doubt? And how we can overcome negative beliefs? | Question 3: Does not having kids change what you ultimately look for in a partner? Is it now less about good parenting ability and more about enjoyment and self-development?',1,1434039240000,14264);
INSERT INTO "Podcasts" VALUES(3042,'557c650d8ead0e30338b460f','Jurassic World: The Untold Story! | Movie Review','An in-depth look at the blockbuster movie "Jurassic World" with Stefan Molyneux. Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park. After 10 years of operation and visitor rates declining, a new attraction is created to re-spark interest and goes horribly wrong!',1,1434215400000,4406);
INSERT INTO "Podcasts" VALUES(3043,'558381578ead0e31338b78d1','Supernatural Death Threat Terrorism - Call In Show - June 13th, 2015','What are the effects of religious leaders convincing their members the end is near - possibly within their lifetime? Do Jehovah Witnesses and other religious organizations use propaganda to create prejudice against non-believers?',1,1434681660000,6169);
INSERT INTO "Podcasts" VALUES(3044,'5584f6958ead0e2c338b8820','The Salvation of Greece. Prepare Yourself Accordingly.','Financial instability has caused a massive bank run in Greece which has resulted in billions of Euros in cash being withdrawn as of Friday night. Despite maneuvering from the Greek Central Bank, the European Central Bank and those in the European Union -  this situation is completely unsustainable. So what''s next? What can be done in the event of economic collapse to allow Greece a sustainable future? Will Greece stay stick with the Euro?  Will Greece leave the European Union?',1,1434777120000,1470);
INSERT INTO "Podcasts" VALUES(3045,'558382b38ead0e30338b7a18','The 97% Consensus? Global Warming Unmasked!','It’s been claimed that ninety-seven percent of scientists agree: climate change is real, man-made and incredibly dangerous. But where does this ninety-seven percent claim come from, and more importantly - is it true? The claim is taken from a paper by Australian John Cook, Climate Communications Fellow for the Global change Institute at the University of Queensland. However, the paper says nothing about the would-be dangers of climate change and it only counts the number of publications, rather than the number of scientists, in support of human-made climate change. Never let facts get in the way of a good story.',1,1434779160000,1998);
INSERT INTO "Podcasts" VALUES(3046,'558383a98ead0efa108b54b7','Dylann Roof: Charleston Church Shooting | True News','Nine people are dead after shooting which occurred 9pm on Wednesday at the Emanuel African Methodist Episcopal Church in Charleston, South Carolina. The congregation, established in 1816, is one of the oldest African American churches in the United States.
INSERT INTO "Podcasts" VALUES(3047,'5587ffe98ead0e0f778b91a7','The Truth About Dylann Roof | Charleston Church Shooting','Nine people are dead after a shooting that occurred on Wednesday at the Emanuel African Methodist Episcopal Church in Charleston, South Carolina. The congregation, established in 1816, is one of the oldest African American churches in the United States.
INSERT INTO "Podcasts" VALUES(3048,'5588507d8ead0efa108b77da','Pickup Artists, Hypergamy and Ostracism - Call In Show - June 17th, 2015','Question 1: When is a good time to change someone’s mind? We live in a society where I feel that most people don''t want to argue with each other - because both sides know that they are not prepared enough or have enough time to convince another person - or are in a too awkward place to argue. Can you balance the coexistence and friendship with arguing and debate? | Question 2: The caller wrote, “Ostracizing someone for moral reasons doesn''t harm the person doing the ostracism, but ostracizing someone for aesthetic reasons absolutely harms the person doing the ostracism.”  Does Stefan''s refusal to endorse (or embrace) hypergamy and his encouragement to ostracize people who defend and/or engage in hypergamous behavior cause great harm to his audience?',1,1434996720000,12905);
INSERT INTO "Podcasts" VALUES(3049,'55895cb48ead0efb798b47f7','Do You Hate The World? | #RageQuitEarth','Listener Question: "The world is not exactly chock full of people who are voluntarist, who''ve got self-knowledge, people who''ve been to therapy, people who have good relationships, people who reject the state and the initiation of force." Nor will it ever be, not even close.  And therein lies the fundamental flaw in your brand of philosophy.  Your ideal society requires for the average human a minimum threshold of intelligence and morality that cannot be met. I find many things you teach very useful on a micro level and they will help many individuals in their quality of life and their relationships, but the debate about extending them to a large enough population to change our societal structure is moot."',1,1435065360000,1349);
INSERT INTO "Podcasts" VALUES(3050,'558ae3f88ead0e002d8b4627','My Dylann Roof Dream | How to Stop Mass Shootings','In the aftermath of the Charleston Church Shooting by Dylann Roof - something just didn''t feel right. Then last night, I had the strangest dream which helped put things into perspective.',1,1435165500000,2071);
INSERT INTO "Podcasts" VALUES(3051,'558b23908ead0e037a8b57e7','Eternal Human Consciousness? - Call In Show - June 20th, 2015','Question: My personal belief in this existence is that the human soul or consciousness, is part of a higher dimensional source which is the source of all energy in the world, and that when we die, we are simply reborn as another person/intelligent being. I would like to know what Stefan thinks (in both a literal and philosophical sense) of the idea that all consciousness is one and the same - and in the end it is what we return to when we die and what sends us back to rebirth.',1,1435181940000,5905);
INSERT INTO "Podcasts" VALUES(3052,'558c5fde8ead0e042d8b5207','An Introduction to Reality ','A brief introduction to reality using a rational methodology. How does one use sense data to conceptualize reality? How is reason derived from evidence? What are concepts and how can we understand them? How do we understand ethics and morality? How does this apply to the world and culture?',1,1435262880000,1923);
INSERT INTO "Podcasts" VALUES(3053,'558cea918ead0e047a8b632f','Anti-Human Propaganda - Call In Show - June 24th, 2015','Question 1: Since nature is connected in a huge ecosystem, how can you be the one to decide what to do with your property if what happens on it will affect everyone? | Question 2: We haven’t done one of these in a while - Stefan analyzes a caller’s dream to see if the unconscious metaphor generator makes any sense when compared to his real world predicament and challenges. An incredibly interesting example of the power of the unconscious mind! | Question 3: There is a disconnect between my inner and outer life. I am very empathetic and I feel deeply about a great many things, but I avoid stress in any form to the point of disassociation and I am very fearful of negative reactions and consequences. I want to stop being dishonest and evasive but I don''t want to make any harmful mistakes. I have come to understand that I am somewhat emotionally inept.  What are some steps that I can take in order to grow an emotional backbone?',1,1435298280000,12130);
INSERT INTO "Podcasts" VALUES(3054,'5591a5768ead0e6f0e8b80df','The Truth About Gene Wars: r/K Selection Theory ','Occasionally new information completely blow your mind -  and this is one of those times! Stefan Molyneux breaks down the basics of the genetic warfare which is the foundation of all living creatures. Different reproduction strategies have emerged over time and this is explained through r/K Selection Theory. When you look at humanity through the lens of reproduction strategies - it''s something you can never, and will never, be able to unsee!',1,1435608180000,3359);
INSERT INTO "Podcasts" VALUES(3055,'5592ef358ead0e082d8b7e12','What Pisses Me Off About The Confederate Flag','The suspect in the Charleston shooting, Dylann Storm Roof, appeared in a number of photographs with the Confederate flag - prompting calls for banning of the flag nationwide as a symbol of racism and hatred. As lawmakers and business respond to the public outcry, Stefan Molyneux looks at the reality of the situation, and breaks down what’s said – and what’s not being said.',1,1435692720000,1057);
INSERT INTO "Podcasts" VALUES(3056,'5595f7558ead0e022d8b95e7','Death by the Drug of Money: Greece, Europe, America and You','Greece has become the first industrialized nation to default on its IMF payments, and the first since Zimbabwe in 2001. Here is the essential information you need to know about fear currency, infinite debt, bank thefts and the dangers of a delusional population.',1,1435891140000,1001);
INSERT INTO "Podcasts" VALUES(3057,'5596461e8ead0e147a8ba4fa','Babies Are Racist - Call In Show - June 27th, 2015','Question 1: When it comes to property ownership - what is the difference between a government and a landlord? | Question 2: If all United Nations member countries removed all work and residency restrictions - this would force nations to quickly create great living and working conditions for their citizens or lose their tax base. This way all nations will improve themselves through competition -principles of the free market applied to dominions. My theory is that ultimately the number of countries would probably drop but a more equitable united world would emerge. So my question is, why isn''t this done currently? | Question 3: I plan on entering the dating world in the near future but am afraid that I don''t represent value to anybody. Do I need to alter myself to have value or do I wait for someone to find value in me?',1,1435911540000,13422);
INSERT INTO "Podcasts" VALUES(3058,'559704568ead0e1d7a8baee9','The Fall of Puerto Rico. Prepare Yourself Accordingly.','Puerto Rico’s economy is in a death spiral and it could threaten the entire United States bond market. How did we get to this point and what does this mean in the big picture? Stefan Molyneux breaks down the unspoken facts about the end of freedom, opportunity, employment and trade in modern Puerto Rico. An in depth explanation about what this means for the average Puerto Rican and Americans overall – spoiler, it’s not good! There will be no economic recovery, prepare yourself accordingly. Sources: http:/www.fdrurl.com/puerto-rico',1,1435960200000,2627);
INSERT INTO "Podcasts" VALUES(3059,'559902c18ead0e002d8ba6e2','The Caller Who Doesn’t Exist - Call In Show - July 3rd, 2015','Question 1: In reference to the Mouse Utopian Experiments by John Calhoun - I believe that mammals must always have something to strive for or else they lose the will to live.  Do you think that the belief in finite horizons is a subconscious kill switch, poisonous to the will to live? | Question 2: I feel a very strong sense of apathy in just about every aspect of my life. I hide this behind a false sense of cheerfulness in the face of strangers, and push those very few who are close to me away when they see the state that I am in. How do I make changes when I feel huge lack of interest or passion for much of anything, nor much desire to do the incredible work necessary to heal my emotional wounds?" | Question 3: You dogmatically cling to a belief in Atheism but do not ascribe it the equal responsibility of proving that God doesn''t exist, rather than simply admitting you don''t know. How can you dismiss with any kind of certainty that religion neither holds value nor truth?',1,1436090940000,9961);
INSERT INTO "Podcasts" VALUES(3060,'559b200f8ead0ec37a8b63df','Greek Referendum: Their Yesterday, Our Tomorrow | True News','No! The resounding answer to the Greek Referendum where 61 percent voted against further austerity in exchange for financial help from Europe and the International Monetary Fund. The vote could lead to the country''s exit from the eurozone within weeks. 
INSERT INTO "Podcasts" VALUES(3061,'559c32668ead0e1d7a8bd09a','What Science Is Telling Us About Fathers | Paul Raeburn and Stefan Molyneux ','GET THE BOOK: http://www.fdrurl.com/paul-raeburn | ‘Do Fathers Matter: What Science Is Telling Us About the Parent We’ve Overlooked’ looks at the latest research in psychology, neuroscience, genetics, anthropology, medicine, and sociology to explore the role of fathers in today’s families. Stefan Molyneux speaks with author Paul Raeburn on the overlooked, but incredibly important role that a father has in the healthy development of his children. | Paul Raeburn is the author of Do Fathers Matter? What Science Is Telling Us About the Parent We’ve Overlooked. Raeburn writes the About Fathers blog for Psychology Today and is the chief media critic for the Knight Science Journalism Tracker at MIT. He contributes to The New York Times, Discover, Scientific American and The Huffington Post. For more, go to: http://www.paulraeburn.com',1,1436299740000,3458);
INSERT INTO "Podcasts" VALUES(3062,'559ce2738ead0e6f0e8bd090','The Voices of the Voiceless - Call In Show - July 4th, 2015','Question 1: How honest should I be with my young kids when it comes to big issues like drugs - while trying to maintain their innocence? I''m afraid to lay the hammer of reality down on them too much or soon but at the same time don''t want them to be ignorant of the world. | Question 2: My young son can be temperamental and aggressive at times - how can I get him to calm down and listen when he gets upset?',1,1436344800000,10295);
INSERT INTO "Podcasts" VALUES(3063,'559cffa68ead0e6f0e8bd141','The Genetics of Politics | Liberals vs. Conservatives | Gene Wars [Part 2}','An examination of the biological and genetic basis for political ideologies: Do genetics determine if you’re a liberal or conservative?  What role does r/K selection theory play in the world where we live?  How big is your amygdala - and what does that mean about your possible political perspective? Includes a look at the Prefrontal Cortex, Anterior Cingulate Cortex and the impact of dopamine in the realm of political biology.',1,1436351700000,4340);
INSERT INTO "Podcasts" VALUES(3064,'559eb26f8ead0eff3a8ba610','The Myth of Passive Victimhood - Call In Show - July 8th, 2015','Question 1: My sister is emotionally dependent on me due to her mental disabilities and a recent family tragedy. My wife feels like my priorities have shifted towards my sister; thus not giving her the attention she needs. How can I strike a balance between these two worlds without also compromising my sanity? | Question 2: How can I talk with my future children about religion? How can I learn to communicate with them without losing my temper, threatening them or raising my voice like my parents did to me? | Question 3: How important do you think communication is in a healthy relationship? If you meet a good girl who is virtuous and has good morals but has poor English and communication skills do you think that the relationship can work?',1,1436463420000,12410);
INSERT INTO "Podcasts" VALUES(3065,'559f037a8ead0e062d8bd5a7','The Fall of China: There Will Be No Economic Recovery.','China just lost over $3 trillion of stock value, what this means to you, your house, your money, your future and your chances for true economic and political freedom.
INSERT INTO "Podcasts" VALUES(3066,'55a13d3c8ead0ed37a8b8c77','Who Will Pay? Austerity vs. Bailouts | Greece, Europe and The Euro!','When debt consumes a country and its financial system collapses - who will pay? Who will be held responsible for the bad decisions, the debt and the malinvestment? 
INSERT INTO "Podcasts" VALUES(3067,'55a4620a8ead0edc7a8ba289','The Role of Men as Providers - Call In Show - July 11th, 2015','Question 1: I’m a former entrepreneur who is currently a stay at home father while my wife earns a living. I’m feeling increasingly frustrated, am generally unhappy and my self-confidence has fallen to the point where I don’t know if I could run a successful business even if the opportunity presented itself. Do you have any thoughts on my wife and I can improve my happiness? | Question 2: I was fired from my job of nine years and since then I''ve been going from one low paying entry-level job to another.  I have a useless degree, recently turned thirty and I feel like I''m stuck.  How can I improve my situation? | Question 3: Given that socially funded research is demonstrably the best method for advancing technology and technology is the leading factor in improving the overall standard of living, how could removing the state not be viewed as detrimental to the progression of mankind? | Question 4: I recently started dating a women who I think will be a good parent for various reasons, but I ran into some potential red flags that I think may become problematic during post-child rearing phase of life. What do you think is a good approach for drawing the line between satisfying own desires vs. satisfying the evolutionary biological imperative of creating more smarter and peaceful generation of kids?',1,1436836080000,13063);
INSERT INTO "Podcasts" VALUES(3068,'55a6fa138ead0edc7a8bb5d2','The Truth About The Euro. Prepare Yourself Accordingly.','Over the years, the general public has been told many false reasons as to why the Euro was necessary. Everything from economic stability - to preventing World War III has been used as justification for the European currency’s existence. In light of the economic crisis in Greece, we strive to answer: What is the truth about the Euro and the European Central Bank? Sources: http://www.fdrurl.com/truth-about-the-euro',1,1437006060000,4681);
